INSERT INTO `copicblock_custom` VALUES (1,'<p>© 2014, WICHE Mental Health Program</p>\r\n','Footer Copy Right Bloci','filtered_html'),(2,'<h2>Important Dates:</h2>\r\n\r\n<p><strong>Application Deadline</strong>:</p>\r\n\r\n<p>December 1, 2017</p>\r\n\r\n<hr />\r\n<p><strong>Interview Notification</strong>:</p>\r\n\r\n<p>December 15, 2017</p>\r\n\r\n<hr />\r\n<p><strong>Interview Dates</strong>:</p>\r\n\r\n<p><em>Videoconference interviews</em>:<br />\r\nJanuary 8 &amp; 10, 2018</p>\r\n\r\n<p><em>In-Person interviews</em>:<br />\r\nJanuary 16-19, 2018</p>\r\n\r\n<p>Las Vegas, NV</p>\r\n\r\n<hr />\r\n<p><strong>2018-2019&nbsp;Cohort Start Date</strong>:</p>\r\n\r\n<p>August 6, 2018</p>\r\n\r\n<hr />\r\n<h2>Contact NV-PIC:</h2>\r\n\r\n<p>Dr. Emily Slife, Incoming Training Director for 2018-19</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nEmail: <a href=\"mailto:eslife@health.nv.gov\">eslife@health.nv.gov</a><br />\r\n<br />\r\nPhone: (702) 486-0711</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','Left Sidebar Block','filtered_html'),(3,'<p><img alt=\"Nevada Psychology Internship Consortium\" src=\"/sites/default/files/sites/default/files/info/nv-pic-logo.png\" style=\"height:164px; width:180px\" /></p>\r\n','Right Logo in header','full_html'),(4,'<ul class=\"hideme\">\r\n	<li><a href=\"/mission-and-philosophy\">Mission &amp; Philosophy</a></li>\r\n	<li><a href=\"/major-training-emphases\">Training &amp; Emphasis</a></li>\r\n	<li><a href=\"/didactics-seminars-case-conferences\">Supervision, Didactics, and Additional Training Experiences</a></li>\r\n	<li><a href=\"/policies-procedures\">Policy &amp; Procedures</a></li>\r\n</ul>\r\n','program-structure sub menu for mobile','full_html'),(5,'<ul class=\"hideme\">\r\n	<li><a href=\"/site-descriptions\">Site Descriptions</a></li>\r\n	<li><a href=\"/faculty-contact-information\">Faculty Contact Information</a></li>\r\n</ul>\r\n','Consortium phone menu','full_html'),(6,'<ul class=\"hideme\">\r\n	<li><a href=\"general-expectations\">General Expectations</a></li>\r\n	<li><a href=\"/life-in-nevada\">Life in Nevada</a></li>\r\n	<li><a href=\"/stipends-benefits\">Stipends Benefits</a></li>\r\n	<li><a href=\"internship-goals-and-objectives\">Internship Goals and Objectives</a></li>\r\n</ul>\r\n','intern-expectations phone menu','filtered_html'),(7,'<h2>Policies and Procedures Menu</h2>\r\n\r\n<ul class=\"menu\">\r\n	<li><a href=\"/policies-procedures\">Policies and Procedures</a></li>\r\n	<li><a href=\"/policies-procedures/NV-PIC Application Process and Selection Criteria\">NV-PIC Application Process and Selection Criteria</a></li>\r\n	<li><a href=\"/policies-procedures/diversity-non_Discrimination-policy\">Diversity and Non-Discrimination Policy</a></li>\r\n	<li><a href=\"/policies-procedures/due-process-grievance-procedures\">Due Process and Grievance Procedures</a></li>\r\n	<li><a href=\"/policies-procedures/intern-evaluation-record-maintenance-procedures\">Intern Evaluation and Record Maintenance Procedures</a></li>\r\n	<li><a href=\"/policies-procedures/stipend-benefits-resources\">Stipend, Benefits, and Resources</a></li>\r\n	<li><a href=\"/policies-procedures/mandatory-training-activities-attendance-policy\">Mandatory Training Activities Attendance Policy</a></li>\r\n	<li><a href=\"/policies-procedures/videoconference-supervision-policy\">Videoconference Supervision Policy</a></li>\r\n	<li><a href=\"/policies-procedures/social-media-policy\">Social Media Policy</a></li>\r\n	<li><a href=\"/policies-procedures/family-medical-leave-policy\">Family &amp; Medical Leave Policy</a></li>\r\n	<li><a href=\"/policies-procedures/reference-guide-NV-PIC-minimum-training-requirements\">Quick Reference Guide for NV-PIC Minimum Training Requirements</a></li>\r\n</ul>\r\n','Policies and Procedures Menu','full_html');
