INSERT INTO `copicfield_revision_body` VALUES ('node','page',0,1,1,'und',0,'<div class=\"welcome\">\r\n<p><strong style=\"font-size:1.2em;\"><em>We are participating in Phase II of the match. Southern Nevada Adult Mental Health Services (SNAMHS) has 2 open positions, 1 for the General track and 1 for the Forensic track. We will be following all APPIC procedures for Phase II. See below for additional information. </em></strong></p>\r\n</div>\r\n\r\n<h2>General Information</h2>\r\n\r\n<p>The Nevada Psychology Internship Consortium (NV-PIC) represents the collaborative effort of three sites within one state agency, the Nevada Division of Public and Behavioral Health (DPBH), to share resources and faculty for the purpose of providing a diversified educational program for psychology interns. NV-PIC offers a one-year, full-time doctoral internship&nbsp;beginning and ending in August each year. The 4-digit general APPIC Program Code for NV-PIC is&nbsp;<strong>2323</strong>.&nbsp;Training takes place at 3 training sites in or around the Reno-Sparks area, Las Vegas, and Carson City. The consortium sites are:</p>\r\n\r\n<ul>\r\n	<li><u>Northern Nevada Adult Mental Health Services (NNAMHS)</u>:&nbsp;The APPIC Program Code for NNAMHS is&nbsp;<strong>2323-13</strong>.</li>\r\n	<li><u>Carson City Rural Clinic (CCRC)</u>:&nbsp;The APPIC Program Code for CCRC is&nbsp;<strong>2323-14</strong>.</li>\r\n	<li><u>Southern Nevada Adult Mental Health Services (SNAMHS)</u>: SNAMHS offers two internship tracks, a clinical-general track and a clinical-forensic&nbsp;track. The tracks are described further in the NV-PIC brochure (below) and on the <a href=\"http://nv-pic.org/node/18\" target=\"_blank\">SNAMHS</a>&nbsp;page.\r\n	<ul>\r\n		<li>The APPIC Program Code for SNAMHS \"general\" track is&nbsp;<strong>2323-12</strong>.</li>\r\n		<li>The APPIC Program Code for SNAMHS \"forensic\" track is&nbsp;<strong>2323-15</strong>.</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p>Click here to download the <strong>NV-PIC Internship Brochure</strong>: <a href=\"http://www.nv-pic.org/sites/default/uploads/2018-19NV-PICbrochure090117.pdf\" target=\"_blank\">2018-2019&nbsp;Brochure</a></p>\r\n\r\n<h3>Applying to NV-PIC</h3>\r\n\r\n<p>The consortium currently offers <strong>4 full-time internship positions</strong>. Applicants may apply to as many sites within the consortium as they wish. Each consortium site has its own unique Match number, including a unique Match number for each track at SNAMHS, so applicants are able to rank sites or tracks according to their preference.</p>\r\n\r\n<p>NV-PIC participates in APPIC\'s online AAPI procedure. Please visit <a href=\"http://www.appic.org\" target=\"_blank\">www.appic.org</a> for more information about the process and to submit an online application.&nbsp;Applications for the 2018-2019&nbsp;internship year are due by <strong>December&nbsp;5, 2017</strong>. Applicants will be notified regarding their interview status on or before December 15. Please see the&nbsp;<a href=\"http://nv-pic.org/application-procedure\" target=\"_blank\">Application Procedures</a>&nbsp;page for more information.</p>\r\n\r\n<h3>Contacting NV-PIC</h3>\r\n\r\n<p>Questions regarding NV-PIC or the application and interview process may be directed to NV-PIC’s Dr. Emily Slife, Incoming Training Director for 2018-19 (<a href=\"mailto:eslife@health.nv.gov\">eslife@health.nv.gov</a>), (702) 486-0711. Site-specific information also can be directed to the site directors, whose contact information can be found on the <a href=\"http://nv-pic.org/node/20\" target=\"_blank\">NV-PIC Faculty</a>&nbsp;page.</p>\r\n\r\n<h2>Accreditation Status</h2>\r\n\r\n<p>.NV-PIC has been accredited, on contingency, by the American Psychological Association since May 18, 2017. Questions related to the program’s accreditation status should be directed to the Commission on Accreditation:</p>\r\n\r\n<p><a href=\"http://www.apa.org/ed/accreditation/index.aspx\" target=\"_blank\"><em>Office of Program Consultation and Accreditation</em></a><br />\r\n<em>American Psychological Association<br />\r\n750 1st Street, NE, Washington, DC 20002<br />\r\nPhone: (202) 336-5979<br />\r\nEmail: </em><a href=\"mailto:apaaccred@apa.org\"><em>apaaccred@apa.org</em></a></p>\r\n\r\n<p>NV-PIC is a proud member of APPIC and participates in the APPIC match (#2323). This internship site agrees to abide by the APPIC policy that no person at this training facility will solicit, accept, or use any ranking-related information from any intern applicant. Member information through the APPIC online directory&nbsp;can be found <a href=\"https://membership.appic.org/directory/display/1680?back=https%3A%2F%2Fmembership.appic.org%2Fdirectory%2Fsearch%3Fsearch%3D1%26program_type_id%3D%26school_name%3Dnevada%26pdir_name%3D%26lead_name%3D%26appic_num%3D%26PROG_Describe%3D%26ID_MSI_KWORDS%3D%26program_country_id%3D%26APP_DUE_START%3D%26APP_DUE_END%3D%26POS_startdate_START%3D%26POS_startdate_END%3D%26ACCR_APA%3D%26ACCR_CPA%3D%26POS_FT_funded%3D%26POS_PT_funded%3D%26POS_FT_low%3D%26POS_FT_high%3D%26POS_PT_low%3D%26POS_PT_high%3D%26SUM_INTOTAL_1112%3D%26STAFF_LICENSED_FT%3D%26STAFF_LICENSED_PT%3D%26ID_SFIP_SupervisePDs%3D%26APP_INTERVENTION%3D%26APP_ASSESSMENT%3D\" target=\"_blank\">here</a>.</p>\r\n\r\n<h3>&nbsp;</h3>\r\n','','full_html'),('node','page',0,2,2,'und',0,'<div>\r\n<h2>Mission &amp; Philosophy</h2>\r\n</div>\r\n','','filtered_html'),('node','page',0,3,3,'und',0,'<h2>NV-PIC includes the following&nbsp;training sites:</h2>\r\n\r\n<ul>\r\n	<li><a href=\"http://www.nv-pic.org/node/17\" target=\"_blank\">Northern Nevada Adult Mental Health Services (NNAMHS)</a></li>\r\n	<li><a href=\"http://www.nv-pic.org/node/19\" target=\"_blank\">Carson City Rural Clinic (CCRC)</a></li>\r\n	<li><a href=\"http://nv-pic.org/node/18\" target=\"_blank\">Southern Nevada Adult Mental Health Services (SNAMHS)</a></li>\r\n</ul>\r\n\r\n<p>Northern Nevada Adult Mental Health Services (<a href=\"http://www.nv-pic.org/node/17\" target=\"_blank\">NNAMHS</a>) and&nbsp;Carson City Rural Clinic (<a href=\"http://www.nv-pic.org/node/19\" target=\"_blank\">CCRC</a>) each&nbsp;will accept one (1) full-time internship position for the 2018-2019&nbsp;cohort. Southern Nevada Adult Mental Health Services (<a href=\"http://nv-pic.org/node/18\" target=\"_blank\">SNAMHS</a>) will accept two (2) full-time internship positions for the 2018-2019 cohort, one (1) for the clinical-generalist track and one (1) for the clinical-forensic track..&nbsp;</p>\r\n\r\n<p>A description of each site and the internship experience by site is located on the&nbsp;pages for each site, linked to above. Contact information for each site is located on the <a href=\"http://nv-pic.org/node/20\">NV-PIC&nbsp;</a><a href=\"http://nv-pic.org/node/20\" target=\"_blank\">Faculty</a>&nbsp;page.</p>\r\n','','filtered_html'),('node','page',0,4,4,'und',0,'<h2>Required Major Training Emphases</h2>\r\n\r\n<p>All sites offer major training emphases in Behavioral Health Intervention, Psychological Assessment, and Consultation and Systems Collaboration.</p>\r\n\r\n<h3><u>Behavioral Health Intervention</u></h3>\r\n\r\n<p>Each consortium site provides opportunities for interns to conduct behavioral health intervention in an inpatient and/or outpatient settings. All sites provide interns the chance to work with a diverse range of underserved clients within a variety of therapeutic modalities. Individual and group therapy treatments with adult clients are most common across agencies, with opportunities to work with children and families available at some. Interns working in inpatient settings have the opportunity to provide individual brief intervention services, behavioral support intervention plans, group treatment, and individualized token economy plans. Clients served across sites range widely in age, race, ethnicity, and diagnostic presentation.&nbsp;</p>\r\n\r\n<h3><u>Psychological Assessment</u></h3>\r\n\r\n<p>Interns at every site administer, interpret, and provide written synthesis of psychological test batteries. Assessments may include record reviews, clinical interviews, intellectual, achievement, personality, and/or competency-based measures. The referral questions and types of assessments differ and may include differential diagnosis, risk assessment, or malingering. Interns have opportunities to write reports and make recommendations that convey meaningful information to clients. While each site varies on the number and type of referrals, interns complete a minimum of 10 assessments throughout the course of the year.</p>\r\n\r\n<h3><u>Consultation and Systems Collaboration</u></h3>\r\n\r\n<p>Interns spend time each week in activities related to consultation and systems collaboration, learning to contribute their clinical work within an interdisciplinary team, across agencies, &nbsp;and to other systems. Collaborative opportunities include working within an interdisciplinary treatment team, providing psychological consultation to other disciplines, and partnering with community social service, legal, and educational systems.​</p>\r\n\r\n<h2>&nbsp;</h2>\r\n','','filtered_html'),('node','page',0,5,5,'und',0,'<h2>Supervision</h2>\r\n\r\n<p>Interns receive a minimum of 2 hours of individual supervision each week from a licensed psychologist at their site. Supplemental weekly individual supervision may be provided by other faculty at each site or other partnering sites. Licensed supervisors provide interns with experientially based clinical training. All NV-PIC interns will be observed directly (either live or electronic) by at least one supervisor during each evaluation time period. Audio recordings and written process recordings also may be utilized by NV-PIC supervisors.</p>\r\n\r\n<p>Two hours of required weekly group supervision from a licensed psychologist is conducted with all interns across consortium sites via high-quality, secure distance technology. Group supervision focuses on case presentation, supervision, topic-focused discussion, intern-led didactics, and professional development. All interns receive a minimum of 4 hours of supervision per week.</p>\r\n\r\n<h2>Didactic Seminars and Case Conferences</h2>\r\n\r\n<p>Opportunities to attend didactic activities such as Case Conferences, staff development trainings, and treatment team meetings vary across internship sites. All interns attend weekly didactic seminars as a group via distance technology.</p>\r\n\r\n<p>Topics for didactic seminars may include:</p>\r\n\r\n<ul>\r\n	<li>Professional Ethics and Nevada Legal Issues</li>\r\n	<li>Co-occuring Treatment</li>\r\n	<li>Chronic Illness Management/Integrated Care</li>\r\n	<li>Competency Evaluations</li>\r\n	<li>Malingering</li>\r\n	<li>Evidence Based Practice for Seriously Mentally Ill</li>\r\n	<li>Dialectical Behavior Therapy (DBT)</li>\r\n	<li>Acceptance and Commitment Therapy (ACT)</li>\r\n	<li>Sex Offender Assessment</li>\r\n	<li>Child and Family Interventions</li>\r\n	<li>Personality Disorders Intervention</li>\r\n	<li>Psychopharmacology - Benefits and Risks</li>\r\n	<li>Working with LGBTQ</li>\r\n	<li>Developmental Disorders</li>\r\n</ul>\r\n\r\n<h2>Research</h2>\r\n\r\n<p>Research opportunities vary by consortium site. Each intern is expected to complete at least one research or program evaluation project during the year, as approved by their primary supervisor. The research project includes a literature review and quantitative, qualitative, or archival data analysis. The focus of the research project is specific to public behavioral health and includes a proposal for a programmatic addition or change to enhance service delivery.</p>\r\n\r\n<h2>Professional Development</h2>\r\n\r\n<p>Interns spend 1 hour per week in a facilitated Peer Professional Development Group (PPDG), which they attend via high-quality, secure distance technology. This meeting, which includes all interns and a licensed psychologist, focuses on promoting personal and professional development within and between interns working in the three internship sites throughout Nevada. Interns can use the group to explore a variety of work related issues. Personal and professional development are fostered through:</p>\r\n\r\n<ol>\r\n	<li>discussion of one’s hopes, expectations and experiences within the internship;</li>\r\n	<li>information, insights and observations offered by group members to other members; and</li>\r\n	<li>individual members observing, listening and participating in the group process.</li>\r\n</ol>\r\n\r\n<p>The function of the group is to provide interns with support, opportunities to learn, grow,&nbsp;apply what they\'ve learned&nbsp;in their work with patients, and share it with colleagues. The PPDG functions like a classroom and a laboratory. It allows interns to learn with and from each other, experiment, take healthy risks, and test ideas. The PPDG also allows interns to&nbsp;share and explore thoughts and feelings about themselves, their patients, and the demands of their work. The PPDG provides a forum for interns to&nbsp;debrief the multitude of experiences (good, bad, and ugly) that occur during the course of their internship education and training.&nbsp;It also allows interns to give and receive feedback about each other’s interpersonal impact, communication style, and personal and professional strengths and weaknesses. In sum, the group is a place to give and receive support and&nbsp;to learn and grow in a group setting that allows each individual to recognize and develop&nbsp;under-developed levels of awareness, skills, and abilities.</p>\r\n','','filtered_html'),('node','page',0,6,6,'und',0,'<p>The Nevada Psychology Internship Consortium (NV-PIC) represents the collaborative effort of three behavioral health agencies within the Nevada Division of Public and Behavioral Health to share resources and faculty for the purpose of providing a broad and general educational program for psychology interns. By the conclusion of the internship year, NV-PIC&nbsp;interns are expected to have achieved competence in&nbsp;the following areas:</p>\r\n\r\n<ol>\r\n	<li>\r\n	<h2>Research</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Ethical and Legal Standards</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Individual and Cultural Diversity</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Professional Values, Attitudes, and Behaviors</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Communication and Interpersonal Skills</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Assessment</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Intervention</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Supervision</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Consultation and Interprofessional/Interdisciplinary Skills</h2>\r\n	</li>\r\n	<li>\r\n	<h2>Public Behavioral Health</h2>\r\n	</li>\r\n</ol>\r\n\r\n<p>For further information on NV-PIC\'s aims, competencies, and training elements, please see <a href=\"/sites/default/uploads/Aims%20and%20Competencies_0.docx\" target=\"_blank\">NV-PIC\'s Aims and Competencies</a>.</p>\r\n','','filtered_html'),('node','page',0,7,7,'und',0,'<h3>Please visit the following pages to learn more about expectations of interns and what interns can expect from NV-PIC:</h3>\r\n\r\n<h3><a href=\"http://nv-pic.org/general-expectations\">General Expectations</a></h3>\r\n\r\n<h3><a href=\"http://nv-pic.org/life-in-nevada\">Life in Nevada</a></h3>\r\n\r\n<h3><a href=\"http://nv-pic.org/stipends-benefits\">Stipends, Benefits, and Resources</a></h3>\r\n\r\n<h3><a href=\"http://nv-pic.org/internship-goals-and-objectives\">Internship Competencies</a></h3>\r\n','','filtered_html'),('node','page',0,8,8,'und',0,'<h2>Stipends, Benefits, and Resources</h2>\r\n\r\n<p>The annual internship stipend across all consortium sites is $28,000. Interns are employed by the Western Interstate Commission for Higher Education (<a href=\"http://www.wiche.edu\" target=\"_blank\">WICHE</a>). WICHE is an intergovernmental organization which provides consultation and technical assistance to the NV-PIC program and serves as the fiscal agent for the internship. Health benefits, annual vacation, professional, and sick leave is provided for all interns.&nbsp;Interns receive 10 days (80 hours) of Paid Time Off (PTO) during the course of the internship year. Additionally, interns are eligible for up to 3 days (24 hours) of Professional Development Release Time, which can include conferences, trainings, dissertation time, or other, as approved by supervisors.&nbsp;In addition, interns receive eleven paid Nevada state holidays.&nbsp;</p>\r\n\r\n<p>NV-PIC interns have access to numerous resources. All interns are provided with office space, a desk, work computer, office phone, voicemail, printers, software, business cards, ID badges, and other basic office supplies. Intervention manuals, assessment materials, other training materials, access to the DSM-5 and ICD-10, and additional materials as needed and approved are provided at each training site, and additional materials that may be needed may be purchased with Training Committee approval. Software for digital scoring of test batteries is available at each site. Funding for travel within the state of Nevada is provided in order for interns to complete required training experiences. In addition to weekly didactic seminars and other professional trainings, interns have access to monthly Grand Rounds provided by the University of Nevada-Reno (UNR) and to a limited number of online academic journals through the Division of Public and Behavioral Health (DPBH) intranet. Each intern has access to administrative and IT support.</p>\r\n','','filtered_html'),('node','page',0,9,9,'und',0,'<h2><strong>Nevada Area Attractions</strong></h2>\r\n\r\n<p>NV-PIC is a consortium program with sites across the diverse landscapes and cultures of Nevada. Interns are placed&nbsp;at one site for the full internship year, but have the opportunity to travel and experience the diverse and unique ecosystems of Nevada. In addition to experiencing the beauty of Nevada, interns who choose to stay in Nevada following internship have opportunities for loan repayment and forgiveness through working in&nbsp;approved&nbsp;<a href=\"http://nhsc.hrsa.gov/\" target=\"_blank\">National Health Service Corps (NHSC)</a> loan repayment sites or through the <a href=\"https://studentaid.ed.gov/sa/repay-loans/forgiveness-cancellation/public-service\" target=\"_blank\">Public Service Loan Forgiveness (PSLF)&nbsp;Program</a>.</p>\r\n\r\n<h2><img alt=\"\" src=\"/sites/default/files/u3/sites/default/uploads/lake%20tahoe.jpg\" /></h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>Southern Nevada</h2>\r\n\r\n<p>One of our internship sites (SNAMHS) is located in the heart of Las Vegas. Las Vegas is well known for its world-class entertainment, day-spas, auto shows, nightclubs, retail, golfing, and fine dining. This 24-hour city offers wildlife habitats, fine art, and museums (dedicated to Neon, ‘The Mob,’ natural history, and more). Recreation within the natural wonders of the nearby Nevada desert includes breathtaking landscapes and spectacular rock formations, such as Red Rock Canyon in the Mohave desert, Lake Mead, the Valley of Fire, and Mount Charleston. Daytrip destinations include: the Grand Canyon, Lake Havasu, the Extraterrestrial Highway and Area 51, Mojave National Preserve, Zion National Park, and Dixie National Forest.</p>\r\n\r\n<p><img alt=\"\" src=\"/sites/default/uploads/las%20vegas%20sign.JPG\" /></p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>Northern Nevada</h2>\r\n\r\n<p>Two of our internship sites are located in the northern region of the state, one in the Reno-Sparks area (NNAMHS) and one in Carson City (CCRC). Carson City, the state capital, small in size but big in stature, is home to many historical sites. Close by are Lake Tahoe to the west, Virginia City to the east, Reno to the north, and Genoa to the south. Reno, “the Biggest Little City in the World,” is 30 minutes away from Carson City and a two- to three-hour drive from major metro areas in northern California (including Sacramento and San Francisco). Northern Nevada is a year-round recreation destination. Activities include skiing, snowboarding, fishing, boating, hiking, wilderness camping, mountain biking, horseback riding, swimming, watersports, and golf courses. Area outdoor recreation venues include the Truckee River, a variety of lakes, including beautiful Lake Tahoe, and the mountains known as the Sierra Nevada. Lake Tahoe has long been considered the “Jewel of the Sierra,” not only for its contribution to the scenic majesty of the area, but also for the adventure that can be found in the region, which includes the largest concentration of ski slopes in the United States and endless mountain biking trails, including Lake Tahoe\'s famous rim trail.</p>\r\n\r\n<p><img alt=\"\" src=\"/sites/default/uploads/great%20american%20balloon%20race.jpg\" /></p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>Statewide Attractions and Events</h2>\r\n\r\n<p>Known for its legal gambling and world-class casinos, Nevada has a rich arts and cultural scene as well. Annual events in Las Vegas include the City of Light Jazz Festival, World Series of Poker tournament, Annual Academy of Country Music Awards, Vegas Uncork’d, Rock ‘n’ Roll Marathon, Electric Daisy Carnival, Motor Trend Auto show, Cirque Du Soleil, Wrangler National Rodeo Finals, Life is Beautiful festival, UNLVino, and the Word Food Championships. In Northern Nevada, Artown in Reno includes a month of live music on the river and other venues around town. Other annual community events include the Reno River Festival, Street Vibrations, Hot August Nights, The Great Reno Balloon Race, National Championship Air Races, Best of the West Rib Cook-off, Virginia City Camel Race, Street Vibrations, Reno Rodeo, Carson Valley Days Festival, and the Burning Man Festival held just a few hours east.</p>\r\n\r\n<p>For more information on visiting and living in Nevada, please visit&nbsp;<a href=\"http://travelnevada.com\" target=\"_blank\">http://travelnevada.com</a>.</p>\r\n','','filtered_html'),('node','page',0,10,10,'und',0,'<h2>Application Process</h2>\r\n\r\n<p>The Consortium currently offers four full-time positions, one position each at NNAMHS and CCRC and two positions at SNAMHS. Students interested in applying for the internship program should submit an online application through the APPIC website (<a href=\"http://www.appic.org\" target=\"_blank\">www.appic.org</a>). NV-PIC is listed in APPIC under Program Code 2323.</p>\r\n\r\n<p>Applicants may apply to as many sites within the consortium as they wish. Each consortium site has its own unique Match number, so applicants are able to rank sites according to their preference. Match numbers for the NV-PIC sites are as follows:</p>\r\n\r\n<ul>\r\n	<li><u>Northern Nevada Adult Mental Health Services (NNAMHS)</u>: 2323-13</li>\r\n	<li><u>Carson City Rural Clinic (CCRC)</u>: 2323-14</li>\r\n	<li><u>Southern Nevada Adult Mental Health Services (SNAMHS) (Clincial-generalist track)</u>: 2323-12</li>\r\n	<li><u>Southern Nevada Adult Mental Health Services (SNAMHS) (Clincial-forensic track)</u>: 2323-15</li>\r\n</ul>\r\n\r\n<hr />\r\n<p>A complete application consists of the following materials:</p>\r\n\r\n<ol>\r\n	<li>A completed online AAPI (APPIC’s standard application)</li>\r\n	<li>Cover letter (part of online AAPI) stating your preferred training site(s) and why you are interested in those sites specifically. <em>Applicants can indicate their interest in more than one site within the consortium in one cover letter.</em></li>\r\n	<li>A current Curriculum Vitae (part of the online AAPI)</li>\r\n	<li>Three standardized reference forms, at least two of which must come from individuals who have directly supervised your clinical and/or research&nbsp;work (part of the online AAPI)</li>\r\n	<li>Official transcripts of <strong>all </strong>graduate coursework (part of the online AAPI)</li>\r\n	<li><em>Supplementary materials</em>: Include a writing sample, such as an integrated assessment report or a clinical case conceptualization. Please redact appropriately.</li>\r\n	<li><em>OPTIONAL voluntary materiaIs: </em>Interns who match with&nbsp;NV-PIC are the employees of the Western Interstate Commission for Higher Education (<a href=\"http://wiche.edu/\">WICHE</a>).&nbsp;It is the policy of WICHE to provide equal employment opportunity to all qualified applicants. As an Affirmative Action Employer, WICHE is required to invite all applicants to complete the forms attached <a href=\"/sites/default/uploads/Appl%20Voluntary%20Self-Identification%20Form.pdf\" target=\"_blank\">here</a>.&nbsp;Completion of the forms is voluntary and will not subject you to any adverse treatment.&nbsp; The information on these forms is confidential and will be maintained separately from your application. If you choose to do so, please download this&nbsp;<a href=\"/sites/default/uploads/Appl%20Voluntary%20Self-Identification%20Form.pdf\" target=\"_blank\">form</a>&nbsp;and upload it with your application. Remember that completion of this form&nbsp;is voluntary and in no&nbsp;way affects the decision regarding your application for employment.&nbsp;</li>\r\n</ol>\r\n\r\n<p>Prospective applicants may contact Dr. Sean&nbsp;Dodge (sdodge@health.nv.gov) or any of the Site Directors for more information about the NV-PIC internship, applications, or the interview&nbsp;procedure.</p>\r\n\r\n<h3>Application Deadline and Interview Process</h3>\r\n\r\n<p>All application materials must be received by <strong>December 1&nbsp;</strong>in order to be considered. Applicants who are invited to interview will be notified by email on or before December 15. Interviews are scheduled in January and will occur either in person or via videoconference. Phone interviews will be provided in cases where videoconference is not an option. Applicants are encouraged but not required to visit consortium sites.</p>\r\n\r\n<p>This internship site agrees to abide by the APPIC policy that no person at this training facility will solicit, accept, or use any ranking-related information from any intern applicant.</p>\r\n\r\n<h2>Selection Criteria</h2>\r\n\r\n<p>NV-PIC bases its selection process on the entire application package noted above; however, applicants who have met the following qualifications prior to beginning internship are considered preferred:</p>\r\n\r\n<ol>\r\n	<li>Current enrollment in good-standing in a psychology doctoral program</li>\r\n	<li>A minimum of 500 intervention hours</li>\r\n	<li>Experience with assessment</li>\r\n	<li>Dissertation proposal defended</li>\r\n	<li>Some experience or special interest in working with underserved or diverse populations</li>\r\n</ol>\r\n\r\n<p>In addition to the preferences noted above, NV-PIC takes into consideration the potential commitment or interest of any prospective intern to remain in Nevada following internship. Developing a strong behavioral health workforce is an important consideration for the state, and an interest in remaining in Nevada to join the workforce is considered a benefit in a potential intern.</p>\r\n\r\n<h2>Post-Match Employment Requirements</h2>\r\n\r\n<p>All interns who match to NV-PIC sites must provide proof of eligibility to work in the United States. NV-PIC does not sponsor work visas. Interns&nbsp;must successfully pass a fingerprint-based background check before beginning employment and&nbsp;must provide results from a tuberculosis (TB) screening test from the previous 12-months. Instructions for providing this information or completing the background check and TB screening will be sent out to all who match after the match is complete.</p>\r\n\r\n<p>In addition, all interns working in non-federally regulated internship programs in the state of Nevada are required to register with the Nevada Board of Psychological Examiners. Information on board registration, including cost, can be found at&nbsp;<a href=\"http://psyexam.nv.gov/Forms/Psychological/\" target=\"_blank\">http://psyexam.nv.gov/Forms/Psychological/</a>.</p>\r\n','','filtered_html'),('node','page',0,11,11,'und',0,'<h2>Policies &amp; Procedures</h2>\r\n\r\n<ul class=\"menu\" style=\"width:50%;\">\r\n	<li><a href=\"/policies-procedures/NV-PIC Application Process and Selection Criteria\">NV-PIC Application Process and Selection Criteria</a></li>\r\n	<li><a href=\"/policies-procedures/diversity-non_Discrimination-policy\">Diversity and Non-Discrimination Policy</a></li>\r\n	<li><a href=\"/policies-procedures/due-process-grievance-procedures\">Due Process and Grievance Procedures</a></li>\r\n	<li><a href=\"/policies-procedures/intern-evaluation-record-maintenance-procedures\">Intern Evaluation and Record Maintenance Procedures</a></li>\r\n	<li><a href=\"/policies-procedures/stipend-benefits-resources\">Stipend, Benefits, and Resources</a></li>\r\n	<li><a href=\"/policies-procedures/mandatory-training-activities-attendance-policy\">Mandatory Training Activities Attendance Policy</a></li>\r\n	<li><a href=\"/policies-procedures/videoconference-supervision-policy\">Videoconference Supervision Policy</a></li>\r\n	<li><a href=\"/policies-procedures/social-media-policy\">Social Media Policy</a></li>\r\n	<li><a href=\"/policies-procedures/family-medical-leave-policy\">Family &amp; Medical Leave Policy</a></li>\r\n	<li><a href=\"/policies-procedures/reference-guide-NV-PIC-minimum-training-requirements\">Quick Reference Guide for NV-PIC Minimum Training Requirements</a></li>\r\n</ul>\r\n\r\n<h2>Evaluation Forms</h2>\r\n\r\n<p><a href=\"/sites/default/uploads/Evaluation_of%20intern%20%28self%20and%20primary%20supervisor%29_FINAL2.xls\" target=\"_blank\">Intern Evaluation</a></p>\r\n\r\n<p><a href=\"/sites/default/uploads/Evaluation_program_final.xls\" target=\"_blank\">Program Evaluation</a></p>\r\n\r\n<p><a href=\"/sites/default/uploads/Evaluation_of_Supervisor_12-15-15.pdf\" target=\"_blank\">Supervisor Evaluation</a></p>\r\n<!--<p><a href=\"/sites/default/uploads/Policy_Application%20Process%20and%20Selection%20Criteria_4.docx\">Application Process and Selection Criteria</a></p>\r\n\r\n<p><a href=\"/sites/default/uploads/Policy_Diversity%20and%20Non-Discrimination_edited_0.docx\">Diversity and Non-Discrimination Policy</a></p>\r\n\r\n<p><a href=\"/sites/default/uploads/NV-PIC%20Due%20Process_edited.docx\" target=\"_blank\">Due Process and Grievance Procedures</a></p>\r\n\r\n<p><a href=\"/sites/default/uploads/Intern%20Evaluation%20and%20Record%20Maintenence%20Policy_0.docx\">Intern Evaluation and Record Maintenance&nbsp;Procedures</a></p>\r\n\r\n<p><a href=\"/sites/default/uploads/Intern%20Stipend%20Benefits%20and%20Resources_edited.docx\">Stipend, Benefits, and Resources</a></p>\r\n\r\n<p><a href=\"/sites/default/uploads/Mandatory%20Training%20Activities%20Policy_edited.docx\">Training Activities&nbsp;Attendance Policy</a></p>\r\n\r\n<p><a href=\"http://www.nv-pic.org/sites/default/uploads/Videoconference%20Supervision%20Policy.docx\">Distance-Mediated Supervision Policy</a></p>\r\n\r\n<p><a href=\"http://www.nv-pic.org/sites/default/uploads/NV-PIC%20Social%20Media%20policy_0.docx\">Social Media Policy</a></p>\r\n\r\n<p><a href=\"http://www.nv-pic.org/sites/default/uploads/NV-PIC%20Family%20and%20Medical%20Leave%20Policy_1.docx\">Family and Medical Leave Policy</a></p>\r\n\r\n<p><a href=\"/sites/default/uploads/Quick%20Reference%20Guide%20for%20NV-PIC_edited.docx\">Quick Reference Guide for NV-PIC Minimum Training Requirements</a></p>-->','','full_html'),('node','page',0,12,12,'und',0,'<h3>Please visit the following pages to learn more about the NV-PIC doctoral internship program:</h3>\r\n\r\n<h3><a href=\"http://nv-pic.org/mission-and-philosophy\">Program Structure, Aim, and Philosophy</a></h3>\r\n\r\n<h3><a href=\"http://nv-pic.org/major-training-emphases\">Training Emphases</a></h3>\r\n\r\n<h3><a href=\"http://nv-pic.org/didactics-seminars-case-conferences\">Supervision, Didactics, and Additional Training Experiences</a></h3>\r\n\r\n<h3><a href=\"http://nv-pic.org/policies-procedures\">Policies and Procedures</a></h3>\r\n','','filtered_html'),('node','page',0,14,14,'und',0,'<h2>Program Structure</h2>\r\n\r\n<p>The Consortium offers one-year, full-time doctoral internships beginning and ending in August. The start date for the 2018-2019&nbsp;cohort is&nbsp;<strong>August 6, 2018</strong>.</p>\r\n\r\n<p>NV-PIC provides a range of clinical and didactic experiences that represents the necessary depth and breadth required for future professional practice within psychology. Interns have a primary placement at one of three sites, with the possibility of receiving additional training experiences&nbsp;with faculty from other sites within the consortium.</p>\r\n\r\n<h2>Program Aim</h2>\r\n\r\n<p>The aim of the Nevada Psychology Internship Consortium (NV-PIC) is to prepare and retain high quality and culturally competent psychologists to provide integrated public behavioral health care for the people of Nevada.</p>\r\n\r\n<h2>Program Philosophy</h2>\r\n\r\n<p>NV-PIC trains clinical psychologists who are effective consumers of research and who utilize scholarly inquiry to inform their practice. NV-PIC offers generalist training, with the opportunity for specialized training that varies across training sites. More information about each training site and the resources and opportunities offered by each is provided under&nbsp;<a href=\"http://nv-pic.org/consortium\" target=\"_blank\">Site Descriptions</a>.</p>\r\n\r\n<h2>Focus on Diversity</h2>\r\n\r\n<p>Nevada is a highly diverse state with a large population of underserved individuals.&nbsp;NV-PIC is committed to promoting diversity in its training program, which includes an investment and commitment to&nbsp;recruiting and retaining staff at all NV-PIC sites&nbsp;who represent culturally and individually diverse backgrounds. NV-PIC also&nbsp;is committed to&nbsp;recruiting and retaining interns who represent culturally and individually diverse backgrounds.&nbsp;Diversity is a core emphasis of the training curriculum, and it is woven into every component of the internship, which creates a supportive learning and employment environment for our interns and staff. Individuals interested in applying for staff positions within NV-PIC\'s training sites may see the Nevada Division of Public and Behavioral Health (DPBH)&nbsp;<a href=\"https://nvapps.state.nv.us/NEATS/Recruiting/ViewJobsHome.aep\" target=\"_blank\">Employment Information</a>&nbsp;website&nbsp;for information about openings.</p>\r\n','','filtered_html'),('node','page',0,15,15,'und',0,'<h2>General Expectations</h2>\r\n\r\n<p>The NV-PIC training program is a year-long, full-time doctoral internship experience, beginning and ending in August. The start date for the 2018-2019 cohort is August 6, 2018.</p>\r\n\r\n<p>Across training sites, interns are expected to complete 2,000 hours of training during the the internship year, of which at least 25% (500 hours) are spent in the provision of direct face-to-face clinical services. This includes completing an average of 10-20 hours per week of face-to-face direct service delivery. Interns are expected to achieve the aims and competencies of the internship program (see <a href=\"http://nv-pic.org/internship-goals-and-objectives\" target=\"_blank\">NV-PIC Competencies</a>) and to abide by the <a href=\"http://www.apa.org/ethics/code/index.aspx\" target=\"_blank\">APA Code of Ethics</a>, the requirements of the NV-PIC training program, and the policies and procedures of their primary training site.</p>\r\n\r\n<p>NV-PIC strives to be a family-friendly internship and welcomes interns from all backgrounds with a variety of family structures and needs. Please contact NV-PIC\'s Training Director should you have any questions.</p>\r\n\r\n<p>NV-PIC has a comprehensive Due Process procedure which outlines the procedure for addressing concerns about intern performance, as well as interns\' concerns about training. These procedures are provided in hard copy to all interns during orientation and are available for download under&nbsp;<a href=\"http://nv-pic.org/policies-procedures\" target=\"_blank\">Policies and Procedures</a>.</p>\r\n','','filtered_html'),('node','page',0,17,17,'und',0,'<h2><em>Please note: NNAMHS is not an active training site for 2018-2019.</em></h2>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h2>Northern Nevada Adult Mental Health Services (NNAMHS)</h2>\r\n\r\n<p>0 Full-Time Position, APPIC Program Code: 2323-13</p>\r\n\r\n<h3>General Information:</h3>\r\n\r\n<p>Located on the scenic Truckee River, Northern Nevada Adult Mental Health Services (NNAMHS) provides comprehensive care primarily to individuals with serious behavioral health disorders in northern Nevada. NNAMHS provides inpatient and outpatient services to adults and their families, serving over 1,600 clients annually. Inpatient care is provided at the Dini-Townsend Psychiatric Hospital, which has a 20 bed Inpatient Unit and an inpatient Rapid Stabilization Unit (RSU) with a 10 bed capacity.</p>\r\n\r\n<p>Several community programs compose the Community Outpatient Services at NNAMHS. Each program focuses on providing behavioral health services to individuals in the community. Below is a list of Community Outpatient Services available at NNAHMS:</p>\r\n\r\n<ul>\r\n	<li>Medication Clinic</li>\r\n	<li>Psychosocial Rehabilitation Program and Peer Support programs</li>\r\n	<li>Housing and Residential Programs</li>\r\n	<li>Psychiatric Case Management</li>\r\n	<li>Assisted Outpatient Treatment (AOT)</li>\r\n	<li>Mental Health and Family Mental Health Courts</li>\r\n	<li>Outpatient Psychological and Counseling Services</li>\r\n</ul>\r\n\r\n<p>The staff for the Community Outpatient Services at NNAMHS includes a variety of disciplines including three psychologists working primarily in outpatient services and one psychologist working primarily in the Dini-Townsend Psychiatric Hospital. The staff of both the inpatient and outpatient programs also include other disciplines such as licensed clinical social workers, marriage and family therapists, licensed alcohol and drug counselors, psychiatrists, advanced practice nurses, registered nurses, case managers, mental health technicians, and consumer service advocates.</p>\r\n\r\n<h3>Internship Experience:</h3>\r\n\r\n<p>Interns at NNAMHS work in outpatient and inpatient settings, serving adults experiencing a wide range of serious mental health problems. Interns receive supervision from staff psychologists.</p>\r\n\r\n<p>Our internship contributes to the development of competent clinical psychologists skilled in diagnosis, psychological treatment, psychological testing, and behavioral consultation with seriously mentally ill adults. Interns learn risk assessment, crisis intervention, interviewing and assessment skills, and other screening techniques. Psychological treatment includes individual as well as group therapy. Work in the inpatient and outpatient settings offer interns an opportunity to work closely with a variety of behavioral health professionals. Treatment approaches include empirically supported strategies, including CBT, DBT, ACT, psychodynamic psychotherapy, motivational interviewing, interpersonal psychotherapy, and solution-focused therapy. The inpatient units at the Dini-Townsend Hospital embrace a recovery model. Interns work with socioeconomically disadvantaged individuals who suffer from a wide range of psychopathology . Interns learn and practice batteries of psychological tests at the start of the year. Psychological testing experience includes not only interpretation of tests, but also integration of interview and history data. There is some degree of flexibility provided to accommodate individual intern interests in terms of the types of clients seen, development and implementation of particular treatment groups, and types of assessment activities.</p>\r\n\r\n<h3>Site Director</h3>\r\n\r\n<p>Jeffrey Corpuel, Ph.D. (<a href=\"mailto:kalaei@health.nv.gov\">jcorpuel@health.nv.gov</a>)</p>\r\n','','filtered_html'),('node','page',0,18,18,'und',0,'<h2>Southern Nevada Adult Mental Health Services (SNAMHS)</h2>\r\n\r\n<p>2 Full-Time Positions:</p>\r\n\r\n<ul>\r\n	<li>1 clinical-generalist (APPIC Program Code: 2323-12)&nbsp;</li>\r\n	<li>1 clinical-forensic track (APPIC Program Code: 2323-15)</li>\r\n</ul>\r\n\r\n<h3>General Information:</h3>\r\n\r\n<p>The Southern Nevada Adult Mental Health Services (SNAMHS) is a behavioral health system that consists of an 88-bed civil inpatient psychiatric hospital, a 78-bed forensic inpatient hospital, and four outpatient community mental health clinics. SNAMHS provides psychiatric and behavioral health services to a diverse population of underserved adults in Southern Nevada, primarily in Las Vegas. SNAMHS provides services to over 14,000 clients each year, including:</p>\r\n\r\n<ul>\r\n	<li>Inpatient Services at Rawson-Neal Psychiatric Hospital for civilly committed patients</li>\r\n	<li>Inpatient Forensic Services at Stein Hospital for patients committed for adjudicative competency concerns</li>\r\n	<li>Assistive Outpatient Treatment (AOT)</li>\r\n	<li>ER Crisis Assessments and Psychiatric Holds</li>\r\n	<li>Specialty Courts (Mental Health Court, Drug Court)</li>\r\n	<li>Housing and Residential programs</li>\r\n	<li>Consumer Drop In Centers</li>\r\n	<li>Medication management, counseling, and supportive services at outpatient clinics</li>\r\n</ul>\r\n\r\n<p>The Department of Forensic and Civil Psychology at&nbsp;SNAMHS provides inpatient services including:</p>\r\n\r\n<ul>\r\n	<li>Psychological testing (e.g., malingering, personality, cognitive, differential diagnosis)</li>\r\n	<li>Clinical interviews</li>\r\n	<li>Evidence-based group and individual psychotherapy interventions (e.g., DBT)</li>\r\n	<li>Developing and implementing positive behavior support plans</li>\r\n	<li>Risk assessments</li>\r\n	<li>Participation on interdisciplinary team meetings</li>\r\n	<li>Client-specific consultations</li>\r\n	<li>Implementation of a token economy system</li>\r\n	<li>Training for hospital staff</li>\r\n</ul>\r\n\r\n<p>Psychologists on froensic units conduct specialty evaluations, including adjudicative competence and comprehensive risk assessments. The psychology team also provides training and support for the competency restoration program. Psychology outpatient services at SNAMHS can include initial comprehensive assessments and diagnostic evaluations, psychological testing, evidence-based group interventions, and individual psychotherapy interventions.</p>\r\n\r\n<p>The psychology department has regularly scheduled staff meetings that focus on continued training, case consultation, program development, and administrative tasks. We also provide monthly trainings open to all staff called Tuesday Talks.</p>\r\n\r\n<h3>Internship Experience:</h3>\r\n\r\n<p>Interns at SNAMHS develop skills and competencies in the assessment and treatment of serious mental illness (SMI), co-occurring disorders, and personality disorders. Interns develop and enhance their skills in the areas of professional development and clinical consultation. Interns at SNAMHS learn to practice as generalists providing diagnostic assessment, consultation, and treatment to a diverse, urban population. Interns have access to SNAMHS\' extensive library of psycholical testing materials. Interns are provided supervised experiences by Licensed Psychologists in clinical assessment, individual and group therapy, development of research projects, and psychoeducational workshops. Supervision for DBT, CBT and mindfulness-based individual and group interventions are available. Interns function as members of interdisciplinary treatment teams and provide consultation and crisis intervention support. Interns participate in weekly case consultation meetings with psychiatric students and residents. Interns learn to consult with direct care staff and to write and implement behavior plans.</p>\r\n\r\n<p>In addition to NV-PIC wide-didatics, interns at SNAMHS particiapte in weekly site didactic trainings and case presentations with postdocs, practicum students, and undergraduate field placements students facilitated primarily by Dr. Bradley. Previous didactic topics have included: expert testimony, civil commitment, malingering, PAI, motivation interviewing, and board complaints/malpractice lawsuits. Interns provide a Tuesday Talks training during the internship year. There are opportunities to participate in outreach events.</p>\r\n\r\n<p>The SNAMHS internship offers one position each on two separate tracks: one <strong>clinical-generalist position</strong> and one <strong>clinical-forensic position</strong>.</p>\r\n\r\n<p><em>SNAMHS Clinical-Generalist Track (APPIC Program Code 2323-12):</em></p>\r\n\r\n<p>The intern on the clinical-generalist track at SNAMHS works primarily with patients in our civil psychiatric hospital, Rawson Neal, engaged in activities to support the patients and treatment team. The intern provides psychological assessments, intervention services, and consultation services, as described above. The intern placed at Rawson Neal may have opportunities to work with forensic patients as well.</p>\r\n\r\n<p><em>SNAMHS Clinical-Forensic Track (APPIC Program Code 2323-15):</em></p>\r\n\r\n<p>The intern on the clinical-forensic track at SNAMHS works with patients who were referred by the court for adjudicative competence concerns. The intern working with the forensic population learns case law related to adjudicative competence and learns how to conduct thorough record reviews, write forensic evaluations, interview forensic patients, and conduct psychological and forensic testing when applicable. Interns have the opportunity to learn forensic assessment instruments such as the ECST-R, M-FAST, SIMS, SIRS, MCAT-CA, and TOMM, to name a few. Interns also learn to conduct comprehensive risk-assessments for self-harm and violence.</p>\r\n\r\n<h3>Site Director:</h3>\r\n\r\n<p>Shera D. Bradley, Ph.D. (<a href=\"mailto:kwalter@health.nv.gov\">sbradley@health.nv.gov</a>)</p>\r\n','','filtered_html'),('node','page',0,19,19,'und',0,'<h2>Carson City Rural Clinic (CCRC)</h2>\r\n\r\n<p>1 Full-Time Position, APPIC Program Code: 2323-14</p>\r\n\r\n<h3>General Information:</h3>\r\n\r\n<p>The Rural Clinics agency provides behavioral health care to underserved individuals with serious behavioral health needs located within one of the 15 rural counties in Nevada. The intern works&nbsp;out of the Carson City clinic, one of the Rural Clinics agencies. Located at the foot of the Sierra Nevada Mountains and approximately 30 minutes from the Reno area, Carson City serves as the State’s capitol and is home to just over 50,000 residents. The Carson City Rural Clinic (CCRC) employs two full time psychologists, as well as several master’s level clinicians, psychiatric nurses, psychiatric case managers, psychiatrists, and psychiatric nurse practitioners. CCRC often serves as a training site for practicum and intern&nbsp;students of various disciplines.</p>\r\n\r\n<p>The professional staff at CCRC provide services to clients both in person and through telehealth to clients based in more remote areas of the state. CCRC staff also provides behavioral health on-call coverage via telehealth to emergency rooms in rural hospitals throughout the state.&nbsp; Staff at the Carson clinic are involved in several community partnerships including Mobile Crisis, Mental Health Court, and Juvenile Justice Diversion. The clinic provides outpatient services to approximately 900 children, adolescents, and adults per year.</p>\r\n\r\n<h3>Internship Experience:</h3>\r\n\r\n<p>Interns placed at CCRC work as part of an interdisciplinary team at an outpatient community behavioral health clinic. The intern provides intervention and assessment services to clients in-person in Carson City and to individuals located in more rural and frontier communities throughout Nevada through telehealth. Interns provide individual, group, and family therapy, conduct initial intake assessments, and provide comprehensive psychological assessments. The intern placed at CCRC receives in-person supervision from one primary psychologist supervisor, with opportunities to receive in-person and/or tele-supervision from other Rural Clinic psychologists. &nbsp;</p>\r\n\r\n<p>Interns receive training to meet the needs of a smaller community by learning to practice as a generalist working with a wide array of clients. Common presenting issues include but are not limited to: trauma, depression and anxiety, psychosis, co-occurring issues, family distress, interpersonal skill deficits, and general distress related to issues of poverty, stigma, and isolation. Interns at CCRC are expected to work with clients across the age spectrum but may be provided some flexibility to focus their caseload predominantly on adults or youth and families, if desired. Additionally, the intern may have the opportunity to receive some exposure to community-based activities such as community outreach, education, prevention, school-based or home-based services, or criminal justice diversion programs. Finally, interns may gain some opportunities to witness and/or participate in the state-legislative proceedings, including policy work on issues specific to psychology or behavioral health in general.</p>\r\n\r\n<h3>Site Director:</h3>\r\n\r\n<p>Don Campbell, Psy.D. (<a href=\"mailto:dcampbell@health.nv.gov\">dcampbell@health.nv.gov</a>)</p>\r\n','','filtered_html'),('node','page',0,20,20,'und',0,'<h2><u>Northern Nevada Adult Mental Health Services (NNAMHS)</u></h2>\r\n\r\n<h3><strong>Jeffrey Corpuel, Ph.D.</strong></h3>\r\n\r\n<ul>\r\n	<li>Phone number: (775)688-2064</li>\r\n	<li>Mailing address: 480 Galletti Way, Sparks, NV 89431</li>\r\n	<li>Email address:&nbsp;<a href=\"mailto:jcorpuel@health.nv.gov\">jcorpuel@health.nv.gov</a></li>\r\n	<li>Roles at NV-PIC: Group Supervisor, NNAMHS Site Director, Primary Supervisor,&nbsp;Training Committee Member</li>\r\n</ul>\r\n\r\n<p>Dr. Jeffrey Corpuel has been a practicing psychologist for 34 years. With a psychodynamic theoretical orientation, he specializes in doing intensive individual psychotherapy and interpersonal group psychotherapy. He has particular interest in treating the underserved and helping those who are suffering most. Dr. Corpuel has a professional focus on the training, supervision and professional development of interns and early career mental health professionals. He is the NV-PIC Site Director for NNAMHS.</p>\r\n\r\n<h3><strong>Kambiz Alaei, Ph.D.</strong></h3>\r\n\r\n<ul>\r\n	<li>Email address:&nbsp;<a href=\"mailto:kalaei@health.nv.gov\">kalaei@health.nv.gov</a></li>\r\n	<li>Roles at NV-PIC: Training Committee Member, Secondary Supervisor</li>\r\n</ul>\r\n\r\n<p>Dr. Kambiz Alaei is a licensed psychologist and the Director of Outpatient Psychology and Counseling Services at the Northern Nevada Adult Mental Health Services (NNAMHS). He completed his BA in psychology from the University of Tehran, Iran. He came to the United States in 1977 to pursue his graduate work. He attended graduate schools in Wichita, Kansas and San Diego, California where he obtained his Master and Ph.D. degrees in Psychology, respectively. Dr. Alaei has practiced in the field of psychology for over thirty years. After twenty years of working in private sectors,&nbsp;he joined the State of Nevada as a Licensed Psychologist I in 2000&nbsp;and has since worked with seriously mentally ill consumers. He has a part-time private practice. Dr. Alaei has provided a wide spectrum of clinical services to children, adolescents, adults and their families (inpatient and outpatient settings). Services include clinical assessment, psychological testing, competency evaluation, crisis intervention, and individual and group therapy. He has received trainings in multiple areas of the psychological field (e.g., CBT, DBT, ACT, MI, IMR). Through the years, Dr. Alaei has provided clinical supervision to many staff at different levels of their professional career (State and private clinicians, Master and Doctoral level Interns and Post-Doctoral fellows). He has participated in program development and evaluation, consultation, training and educating staff in evidence-based practices and interventions. When he is not in session, glued to his computer desk, or in meetings, he spends time with his family, works in the garden, plays soccer, hikes, jogs and socializes with friends. He currently resides in Reno, Nevada with his wife, daughter and family cat (Chester).</p>\r\n\r\n<h2><u>Carson City Rural Clinic (CCRC)</u></h2>\r\n\r\n<h3><strong>Sean Dodge,&nbsp;Psy.D.</strong></h3>\r\n\r\n<ul>\r\n	<li>Phone number: (775)782-3671, ext 239</li>\r\n	<li>Mailing address: 1528 US Hwy 395 North, Suite 100, Gardnerville, NV 89410</li>\r\n	<li>Email address:&nbsp;<a href=\"mailto:sdodge@health.nv.gov\">sdodge@health.nv.gov</a></li>\r\n	<li>Roles at NV-PIC: Outgoing Training Director, Secondary Supervisor,&nbsp;Training Committee Member</li>\r\n</ul>\r\n\r\n<p>Dr. Sean Dodge has worked for the Nevada Division of Public and Behavioral Health’s Rural Clinics agency since 2010. He has served as the NV-PIC Training Director from its inception through 2017. Dr. Dodge earned his Psy.D. from Pacific University in Oregon with a focus on adolescent psychology. Dr. Dodge completed his internship at an adolescent treatment facility in Doylestown, PA and moved to Nevada in 2009 to complete his postdoctoral training working with adults at NNAMHS. Dr. Dodge’s training and experience has almost exclusively focused on treating adolescents and adults in community behavioral health settings. Dr. Dodge has been trained in and practices from an Acceptance and Commitment Therapy (ACT) perspective. Dr. Dodge also has many years of training and experience with a wide range of psychological assessments including objective personality, cognitive, and neurocognitive measures. In addition to direct clinical work,&nbsp;Dr. Dodge’s professional interests include training and supervision, treatment effectiveness for underserved clients, and the role of psychology in community and public health including population-based initiatives, public policy, and the integration of behavioral health with other social support services. Dr. Dodge serves as a secondary supervisor with a focus on child and adolescent cases, psychological assessment, and treatment from an ACT approach.</p>\r\n\r\n<h3><strong>Donald Campbell, Ph.D.</strong></h3>\r\n\r\n<ul>\r\n	<li>Email address:&nbsp;<a href=\"mailto:dcampbell@health.nv.gov\">dcampbell@health.nv.gov</a></li>\r\n	<li>Roles at NV-PIC: CCRC Site Director, Training Committee Member, Primary Supervisor</li>\r\n</ul>\r\n\r\n<p>Dr. Donald Campbell grew up in New Mexico and spent time in Latin America and Spain working as a graphics artist and teaching English as a second language. He has a Bachelor of Arts degree from the University of New Mexico and a Master of Arts degree in Latin American Studies from the University of New Mexico. He earned a Master of Science Degree in Clinical Psychology from Capella University. His Doctor of Psychology degree was earned through Argosy University in Phoenix, Arizona. Dr. Campbell completed his doctoral internship at Tarzana Treatment Centers in California and his post-doctoral training at Apache Behavioral Health Services in Whiteriver, Arizona, where he supervised the Adult Mental Health Program for the White Mountain Apache Tribe. Dr. Campbell has been with the State of Nevada since 2013 and brings a wealth of clinical and cultural knowledge to his current position of Licensed Psychologist I with Carson City Rural Clinic (CCRC).&nbsp;</p>\r\n\r\n<h2><u>Southern Nevada Adult Mental Health Services (SNAMHS)</u></h2>\r\n\r\n<h3><strong>Shera Bradley, Ph.D.</strong></h3>\r\n\r\n<ul>\r\n	<li>Phone number: (702)486-6466</li>\r\n	<li>Mailing address: 6161 West Charleston, Las Vegas, NV 89146</li>\r\n	<li>Email address:&nbsp;<a href=\"mailto:sbradley@health.nv.gov\">sbradley@health.nv.gov</a></li>\r\n	<li>Roles at NV-PIC: SNAMHS Site Director, Primary Supervisor,&nbsp;Training Committee Member</li>\r\n</ul>\r\n\r\n<p>Dr. Shera Bradley earned her Ph.D. in Clinical Psychology from UNLV in 2007 and has been a Licensed Psychologist since 2008. Her educational focus has been Forensic Psychology since beginning her Master’s program in 1998. Following graduation in 2007, Dr. Bradley worked in a private practice setting 2007 to 2015. Her private practice work was focused on conducting forensic evaluations, including competency, death penalty mitigation, child custody, and other civil and criminal evaluations. Further, she created and founded a unique, comprehensive, outpatient treatment program for juvenile victims of human sex trafficking in 2007. She has been interviewed on several occasions by media and appeared in&nbsp;<em>Tricked,</em>&nbsp;a documentary about human trafficking. She has conducted numerous trainings about human trafficking and was a member of the Southern Nevada Human Trafficking Task Force Training Committee. Dr. Bradley has been comprehensively trained in Dialectical Behavior Therapy (DBT) since 2010. Dr. Bradley is an Adjunct Assistant Professor at UNLV and has taught a variety of undergraduate and graduate courses since 2001. Dr. Bradley began employment with SNAMHS in November 2015 and started the Department of Forensic Psychology. In 2016, she became the Director of Forensic &amp; Civil Psychology and oversees forensic inpatient, civil inpatient, and outpatient psychology. She is the NV-PIC Site Director for SNAMHS.</p>\r\n\r\n<h3><strong>Christine Moninghoff, D.B.H.</strong></h3>\r\n\r\n<ul>\r\n	<li>Email address:&nbsp;<a href=\"mailto:christinemoninghoff@health.nv.gov\">christinemoninghoff@health.nv.gov</a></li>\r\n	<li>Roles at NV-PIC: Didactics Coordinator, Primary Supervisor,&nbsp;Training Committee Member</li>\r\n</ul>\r\n\r\n<p>Dr. Christine Moninghoff has been providing mental health services to clients/patients for the past 13 years as an employee of the State of Nevada.&nbsp;In her current position as a licensed psychologist, she has responsibility for providing psychological services on an inpatient unit at Rawson-Neal Hospital. She provides work direction and supervision to interns and doctoral students in conducting assessments, providing therapy, facilitating groups, and working with multidisciplinary teams.&nbsp;Dr. Moninghoff received her D.B.H. from Arizona State University, a Master’s Degree in Clinical Psychology from the University of Hartford, and undergraduate work at Seton Hall University in South Orange, NJ.&nbsp;Dr. Moninghoff completed her internship at High Desert State Prison in Indian Springs, NV.&nbsp;She has been a Faculty Associate at Arizona State University and is currently a Faculty Associate at the Cummings Graduate Institute for Behavioral Health Studies&nbsp; Dr. Moninghoff has a private practice located in North Las Vegas.&nbsp;</p>\r\n\r\n<h3><strong>Emily Slife, Ph.D.</strong></h3>\r\n\r\n<ul>\r\n	<li>Email address: <a href=\"http://mailto:eslife@health.nv.gov\">eslife@health.nv.gov</a></li>\r\n	<li>Roles at NV-PIC: Incoming Training Director, Training Committee Member, Secondary Supervisor</li>\r\n</ul>\r\n\r\n<p>Dr. Emily&nbsp;Slife is the incoming Training Director for NV-PIC for the 2018-19 year. Dr. Slife received her Ph.D. in Counseling Psychology from the University of Missouri-Kansas City in 2007 and has been a Licensed Psychologist since 2010. Dr. Slife has taught a variety of psychology and counseling courses as well as provided therapeutic services at 7 universities across the country. She has also worked at a VA hospital and community mental health agencies. Dr. Slife enjoys working with diverse and underserved populations and has a passion for training and supervising mental health professionals. Dr. Slife joined SNAMHS in October 2017 with experience developing and maintaining an APA-accredited internship program. She is enthusiastic to be part of NV-PIC!</p>\r\n\r\n<h2>Other Faculty</h2>\r\n\r\n<h3><strong>Steven Graybar, Ph.D.</strong></h3>\r\n\r\n<ul>\r\n	<li>Roles at NV-PIC: Peer Professional Development Group Leader</li>\r\n</ul>\r\n\r\n<p>Dr. Steven Graybar is a clinical psychologist who received his M.A. and Ph.D. from the University of Nevada- an APA approved training program. He took a postdoctoral fellowship in clinical psychology in the University of Rochester School of Medicine in Rochester, New York. He divides his time between his private practice&nbsp;and teaching psychotherapy in the University of Nevada School of Medicine’s Department of Psychiatry. In addition he consults in project ECHO a program offered through the Office of Statewide Initiatives within the School of Medicine. Within Project ECHO, he provides professional support and consultation to providers of mental health services in rural areas of Nevada. His clinical interests include psychodynamic approaches to individual and couple therapy and psychodynamic conceptualizations and treatment of addiction, grief, and chronic illness.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','','filtered_html'),('node','page',0,21,21,'und',0,'<h2>Program Structure</h2>\r\n\r\n<p>The Consortium offers one-year, full-time doctoral internships beginning and ending in August. The start date for the 2018-2019&nbsp;cohort is&nbsp;<strong>August 6, 2018</strong>.</p>\r\n\r\n<p>NV-PIC provides a range of clinical and didactic experiences that represents the necessary depth and breadth required for future professional practice within psychology. Interns have a primary placement at one of three sites, with the possibility of receiving additional training experiences&nbsp;with faculty from other sites within the consortium.</p>\r\n\r\n<h2>Focus on Diversity</h2>\r\n\r\n<p>Nevada is a highly diverse state with a large population of underserved individuals.&nbsp;NV-PIC is committed to promoting diversity in its training program, which includes an investment and commitment to&nbsp;recruiting and retaining staff at all NV-PIC sites&nbsp;who represent culturally and individually diverse backgrounds. NV-PIC also&nbsp;is committed to&nbsp;recruiting and retaining interns who represent culturally and individually diverse backgrounds.&nbsp;Diversity is a core emphasis of the training curriculum, and it is woven into every component of the internship, which creates a supportive learning and employment environment for our interns and staff. Individuals interested in applying for staff positions within NV-PIC\'s training sites may see the Nevada Division of Public and Behavioral Health (DPBH)&nbsp;<a href=\"https://nvapps.state.nv.us/NEATS/Recruiting/ViewJobsHome.aep\" target=\"_blank\">Employment Information</a>&nbsp;website&nbsp;for information about openings.</p>\r\n','','filtered_html'),('node','page',0,22,22,'und',0,'<p>&nbsp;</p>\r\n\r\n<h2>Program Aim</h2>\r\n\r\n<p>The aim of the Nevada Psychology Internship Consortium (NV-PIC) is to prepare and retain high quality and culturally competent psychologists to provide integrated public behavioral health care for the people of Nevada.</p>\r\n\r\n<h2>Program Philosophy</h2>\r\n\r\n<p>NV-PIC trains clinical psychologists who are effective consumers of research and who utilize scholarly inquiry to inform their practice. NV-PIC offers generalist training, with the opportunity for specialized training that varies across training sites. More information about each training site and the resources and opportunities offered by each is provided under&nbsp;<a href=\"http://nv-pic.org/consortium\" target=\"_blank\">Site Descriptions</a>.</p>\r\n','','filtered_html'),('node','page',0,23,23,'und',0,'<h2>Program Structure</h2>\r\n\r\n<p>The Consortium offers one-year, full-time doctoral internships beginning and ending in August. The start date for the 2018-2019&nbsp;cohort is&nbsp;<strong>August 6, 2018</strong>.</p>\r\n\r\n<p>NV-PIC provides a range of clinical and didactic experiences that represents the necessary depth and breadth required for future professional practice within psychology. Interns have a primary placement at one of three sites, with the possibility of receiving additional training experiences&nbsp;with faculty from other sites within the consortium.</p>\r\n\r\n<h2>Focus on Diversity</h2>\r\n\r\n<p>Nevada is a highly diverse state with a large population of underserved individuals.&nbsp;NV-PIC is committed to promoting diversity in its training program, which includes an investment and commitment to&nbsp;recruiting and retaining staff at all NV-PIC sites&nbsp;who represent culturally and individually diverse backgrounds. NV-PIC also&nbsp;is committed to&nbsp;recruiting and retaining interns who represent culturally and individually diverse backgrounds.&nbsp;Diversity is a core emphasis of the training curriculum, and it is woven into every component of the internship, which creates a supportive learning and employment environment for our interns and staff. Individuals interested in applying for staff positions within NV-PIC\'s training sites may see the Nevada Division of Public and Behavioral Health (DPBH)&nbsp;<a href=\"https://nvapps.state.nv.us/NEATS/Recruiting/ViewJobsHome.aep\" target=\"_blank\">Employment Information</a>&nbsp;website&nbsp;for information about openings.</p>\r\n','','filtered_html'),('node','page',0,24,24,'und',0,'<h2>Program Structure</h2>\r\n\r\n<p>The Consortium offers one-year, full-time doctoral internships beginning and ending in August. The start date for the 2018-2019&nbsp;cohort is&nbsp;<strong>August 6, 2018</strong>.</p>\r\n\r\n<p>NV-PIC provides a range of clinical and didactic experiences that represents the necessary depth and breadth required for future professional practice within psychology. Interns have a primary placement at one of three sites, with the possibility of receiving additional training experiences&nbsp;with faculty from other sites within the consortium.</p>\r\n\r\n<h2>Program Aim</h2>\r\n\r\n<p>The aim of the Nevada Psychology Internship Consortium (NV-PIC) is to prepare and retain high quality and culturally competent psychologists to provide integrated public behavioral health care for the people of Nevada.</p>\r\n\r\n<h2>Program Philosophy</h2>\r\n\r\n<p>NV-PIC trains clinical psychologists who are effective consumers of research and who utilize scholarly inquiry to inform their practice. NV-PIC offers generalist training, with the opportunity for specialized training that varies across training sites. More information about each training site and the resources and opportunities offered by each is provided under&nbsp;<a href=\"http://nv-pic.org/consortium\" target=\"_blank\">Site Descriptions</a>.</p>\r\n\r\n<h2>Focus on Diversity</h2>\r\n\r\n<p>Nevada is a highly diverse state with a large population of underserved individuals.&nbsp;NV-PIC is committed to promoting diversity in its training program, which includes an investment and commitment to&nbsp;recruiting and retaining staff at all NV-PIC sites&nbsp;who represent culturally and individually diverse backgrounds. NV-PIC also&nbsp;is committed to&nbsp;recruiting and retaining interns who represent culturally and individually diverse backgrounds.&nbsp;Diversity is a core emphasis of the training curriculum, and it is woven into every component of the internship, which creates a supportive learning and employment environment for our interns and staff. Individuals interested in applying for staff positions within NV-PIC\'s training sites may see the Nevada Division of Public and Behavioral Health (DPBH)&nbsp;<a href=\"https://nvapps.state.nv.us/NEATS/Recruiting/ViewJobsHome.aep\" target=\"_blank\">Employment Information</a>&nbsp;website&nbsp;for information about openings.</p>\r\n','','filtered_html'),('node','page',0,25,25,'und',0,'<p>NV-PIC currently offers 4 full-time positions. Students interested in applying for the internship program should submit an online application through the APPIC website (<a href=\"http://www.appic.org\" target=\"_blank\">www.appic.org</a>).</p>\r\n\r\n<p>A complete application consists of the following materials:</p>\r\n\r\n<ol>\r\n	<li>A completed online AAPI (APPIC’s standard application)</li>\r\n	<li>Cover letter (part of online AAPI) stating your preferred training site(s) and why you are interested in those sites specifically. Applicants can indicate their interest in more than one site within the consortium in one cover letter.</li>\r\n	<li>A current Curriculum Vitae (as part of the online AAPI)</li>\r\n	<li>Three standardized reference forms, at least two of which must come from individuals who have directly supervised your work (as part of the online AAPI)</li>\r\n	<li>Official transcripts of all<strong> </strong>graduate coursework (as part of the online AAPI)</li>\r\n	<li>Supplementary materials: Include a writing sample, such as an integrated assessment report or a clinical case conceptualization. Please redact appropriately.</li>\r\n	<li>OPTIONAL voluntary materiaIs: Interns who match with NV-PIC are the employees of the Western Interstate Commission for Higher Education (WICHE). It is the policy of WICHE to provide equal employment opportunity to all qualified applicants. As an Affirmative Action Employer, WICHE is required to invite all applicants to complete certain forms. Completion of the forms is voluntary and will not subject you to any adverse treatment.&nbsp; The information on these forms is confidential and will be maintained separately from your application. If you choose to do so, please download the forms <a href=\"/sites/default/uploads/sites/default/files/info/Appl_Voluntary_Self-Identification_Form.pdf\" target=\"_blank\">here</a>, and upload it with your application. Remember that completion of this form is voluntary and in no way affects the decision regarding your application for employment.</li>\r\n</ol>\r\n\r\n<p>All application materials must be received by December 1 in order to be considered. Applicants who are invited to interview will be notified by email on or before the December 15 deadline. Interviews will be scheduled in January and will occur either in person or via videoconference. Phone interviews will be provided in cases where videoconference is not an option. Applicants are encouraged but not required to visit consortium sites.</p>\r\n\r\n<p>NV-PIC bases its selection process on the entire application package noted above; however, applicants who have met the following qualifications prior to beginning internship are considered preferred:</p>\r\n\r\n<ol>\r\n	<li>Current enrollment and in good-standing in a psychology doctoral program</li>\r\n	<li>A minimum of 500 intervention hours</li>\r\n	<li>Experience with assessment</li>\r\n	<li>Dissertation proposal defended</li>\r\n	<li>Some experience or special interest in working with underserved or diverse populations</li>\r\n</ol>\r\n\r\n<p>In addition to the preferences noted above, NV-PIC takes into consideration the potential commitment or interest of any prospective intern to remain in Nevada following internship. Developing a strong behavioral health workforce is an important consideration for the state, and an interest in remaining in Nevada to join the workforce is considered a benefit in a potential intern.</p>\r\n\r\n<p>Questions regarding the application or interview process may be directed to the NV-PIC Training Director.</p>\r\n\r\n<p>All interns who match to NV-PIC sites must provide proof of eligibility to work in the United States. NV-PIC does not sponsor work visas. Interns must successfully pass a fingerprint-based background check before beginning employment and must provide results from a tuberculosis (TB) screening test from the previous 12-months. Instructions for providing this information or completing the background check and TB screening will be sent out to all who match after the match is complete.</p>\r\n','','full_html'),('node','page',0,26,26,'und',0,'<p>Consistent with the policies of the Division of Public and Behavioral Health, the Nevada Psychology Internship Consortium strongly values diversity and believes in creating an equitable, hospitable, appreciative, safe, and inclusive learning environment for its interns. Diversity among interns and supervisors enriches the educational experience, promotes personal growth, and strengthens communities and the workplace. Every effort is made by NV-PIC to create a climate in which all staff and interns feel respected, comfortable, and in which success is possible and obtainable. NV-PIC strives to make every effort to increase awareness, dispel ignorance, and increase comfort with multicultural experiences. NV-PIC’s training program includes an expected competency in diversity training, and multiple experiences are provided throughout the year to be sure that interns are both personally supported and well-trained in this area.</p>\r\n\r\n<p>NV-PIC welcomes applicants from diverse backgrounds. The training program believes that a diverse training environment contributes to the overall quality of the program. NV-PIC provides equal opportunity to all prospective interns and does not discriminate because of a person’s race, color, religion, sex, national origin, age, disability, sexual orientation, gender identity, or any other factor that is not directly relevant to success as a psychology intern. Applicants are individually evaluated in terms of quality of previous training, practicum experiences, and fit with the internship. If an applicant or intern requires accommodations, he or she should contact the internship training director to initiate this process.</p>\r\n\r\n<p>NV-PIC interns also are subject to and protected by the Governor’s Policy against Sexual Harassment and Discrimination, which can be found here: <a href=\"http://hr.nv.gov/uploadedFiles/hrnvgov/Content/Sections/EEO/Discrimination/PERD42-11-GovernorsPolicySHD.pdf\" target=\"_blank\">http://hr.nv.gov/uploadedFiles/hrnvgov/Content/Sections/EEO/Discrimination/PERD42-11-GovernorsPolicySHD.pdf</a>. Complaints regarding discrimination or harassment involving employees of the Division of Public and Behavioral Health must be referred to the Division’s Personnel Officer.</p>\r\n','','full_html'),('node','page',0,27,27,'und',0,'<p><strong>Due Process Procedures: </strong>For situations in which a supervisor or other faculty member raises a concern about the functioning of a psychology intern. These procedures are a protection of intern rights and are implemented to afford the intern with every reasonable opportunity to remediate problems and to receive support and assistance. These procedures are not intended to be punitive.</p>\r\n\r\n<h2>Definition of a Problem</h2>\r\n\r\n<p>For purposes of this document, a problem is defined broadly as an interference in professional functioning which is reflected in one or more of the following ways: 1) an inability and/or unwillingness to acquire and integrate professional standards into one\'s repertoire of professional behavior; 2) an inability to acquire professional skills to reach an acceptable level of competency; and/or 3) an inability to control psychological dysfunctions and/or excessive emotional reactions which interfere with professional functioning.</p>\r\n\r\n<p>It is a professional judgment as to when an issue becomes problematic rather than a behavior of concern. Intern trainees may exhibit behaviors, attitudes or characteristics that, while of concern and requiring attention, are not unexpected or excessive for professionals in training. Issues typically become identified as problems that require remediation when they include one or more of the following characteristics:</p>\r\n\r\n<ol>\r\n	<li>the intern does not acknowledge, understand, or address the problem when it is identified;</li>\r\n	<li>the problem is not merely a reflection of a skill deficit which can be rectified by the scheduled sequence of clinical or didactic training;</li>\r\n	<li>the quality of services delivered by the intern is sufficiently negatively affected;</li>\r\n	<li>the problem is not restricted to one area of professional functioning;</li>\r\n	<li>a disproportionate amount of attention by training personnel is required;</li>\r\n	<li>the trainee\'s behavior does not change as a function of feedback and/or time;</li>\r\n	<li>the problematic behavior has potential for ethical or legal ramifications if not addressed;</li>\r\n	<li>the intern\'s behavior negatively impacts the public view of the agency;</li>\r\n	<li>the problematic behavior negatively impacts the intern cohort;</li>\r\n	<li>the problematic behavior potentially causes harm to a patient; and/or,</li>\r\n	<li>the problematic behavior violates appropriate interpersonal communication with agency staff.</li>\r\n</ol>\r\n\r\n<h2>Administrative Hierarchy and Definitions</h2>\r\n\r\n<p>NV-PIC’s Due Process procedure occurs in a step-wise fashion, involving greater levels of intervention as a problem increases in persistence, complexity, or level of disruption to the training program. Faculty roles included herein are defined as follows:</p>\r\n\r\n<ul>\r\n	<li>Supervisor: Any faculty member who provides direct supervision or teaching to an intern.</li>\r\n	<li>Training Director (TD): The supervisor who functions as the director of training. The TD leads the Internship Training Committee and serves as a voting member.</li>\r\n</ul>\r\n\r\n<h2>Informal Review</h2>\r\n\r\n<p>When a supervisor believes that an intern’s behavior is becoming problematic, the first step in addressing the issue should be to raise the issue with the intern directly and as soon as feasible in an attempt to informally resolve the problem. This may include increased supervision, didactic training, and/or structured readings. This process should be documented in writing in supervision notes and discussed with the Training Director and Training Committee, but will not become part of the intern’s professional file.</p>\r\n\r\n<h2>Formal Review</h2>\r\n\r\n<p>If an intern’s problem behavior persists following an attempt to resolve the issue informally, or if an intern receives a rating below a “2” on any competency within the first (3-month) supervisory evaluation or below a “3” on any competency on any subsequent supervisory evaluation, the following process is initiated:</p>\r\n\r\n<ol>\r\n	<li>The supervisor will meet with the TD and intern within 10 working days to discuss the problem and determine what action needs to be taken to address the issue. If the TD is the intern’s direct supervisor, an additional supervisor and member of the Training Committee will be included in the meeting.<br />\r\n	&nbsp;</li>\r\n	<li>The intern will have the opportunity to provide a written statement related to his/her response to the problem. The intern must submit the response to his/her primary supervisor and the TD within 5 working days of the meeting described in Step 1.<br />\r\n	&nbsp;</li>\r\n	<li>&nbsp;After discussing the problem and the intern\'s response, the supervisor and TD may:<br />\r\n	&nbsp;\r\n	<ol type=\"a\">\r\n		<li>Issue a decision of “No Cause,” which indicates the determination that the intern’s actions may not constitute a formal problem, but rather a concern as defined above in the “Definition of a Problem.” The awareness of the concern may be sufficient to rectify the issue and many not warrant further formal remediation. In this case, the intern may choose to have a written statement identifying that a formal review was held and that the claim was dismissed due to “No Cause.” If elected, the TD will issue this statement within 10 working days of the meeting. The statement will be placed in the intern’s professional file, and, at the intern’s discretion, may be sent to the Director of Clinical Training at the intern’s doctoral institution. The intern also may choose to have no documentation written and/or sent to the Director of Clinical Training.<br />\r\n		&nbsp;</li>\r\n		<li>Issue an \"Acknowledgement Notice\" which formally acknowledges:\r\n		<ol type=\"i\">\r\n			<li>that the faculty is aware of and concerned with the problem;</li>\r\n			<li>that the problem has been brought to the attention of the intern;</li>\r\n			<li>what steps the faculty and intern will take to rectify the problem or skill deficits addressed by the inadequate evaluation rating; and,</li>\r\n			<li>that the problem is not significant enough to warrant further remedial action at this time.<br />\r\n			<br />\r\n			<em>This notice will be issued within 10 working days of the meeting</em><br />\r\n			&nbsp;</li>\r\n		</ol>\r\n		</li>\r\n		<li>Place the intern on \"Probation\" which defines a relationship such that the faculty, through the supervisors and TD, actively and systematically monitor, for a specific length of time, the degree to which the intern addresses, changes, and/or otherwise improves the problematic behavior or skill deficit. The length of the probation period will depend upon the nature of the problem and will be determined by the intern’s supervisor and TD. A written Probation statement is shared with the intern and the Director of Clinical Training at the intern’s graduate institution and includes:<br />\r\n		&nbsp;\r\n		<ol type=\"i\">\r\n			<li>the actual behaviors or skills associated with the problem;</li>\r\n			<li>the specific recommendations for rectifying the problem;</li>\r\n			<li>the time frame for the probation during which the problem is expected to be ameliorated; and,</li>\r\n			<li>the procedures designed to ascertain whether the problem has been appropriately rectified.</li>\r\n		</ol>\r\n		This statement will be issued within 10 working days of the decision. At the end of this probation period, the TD will provide a written statement indicating whether or not the problem has been remediated. This statement will become part of the intern’s permanent file and also will be shared with the intern and sent to the Director of Clinical Training at the intern’s graduate institution.</li>\r\n		<li>In special cases, the intern may be moved to another training site within NV-PIC. This option would be applicable in situations in which it is believed that the intern’s difficulties are the result of a poor “fit” between the intern and the training site and that the intern could be successful in a different placement. This option would require a meeting of a review panel convened by the Training Director and will consist of the TD, the intern’s primary supervisor, and at least two other members of the Training Committee. The intern may be requested to attend this meeting as well. Additional parties who are knowledgeable about the intern’s abilities also may be involved in order to inform decision making. This meeting, if deemed necessary by the TD, will be convened within 10 working days of determining that the above processes (a, b, or c) were unable to rectify the problem adequately.<br />\r\n		&nbsp;</li>\r\n	</ol>\r\n	</li>\r\n	<li>&nbsp;If the problem is not rectified through the above processes, or if the problem represents gross misconduct or ethical violations that have the potential to cause harm, the intern’s placement within NV-PIC may be terminated. The decision to terminate an intern’s placement would be made by the entire Training Committee and would represent a discontinuation of participation by the intern within every aspect of the training program. The Training Committee would make this determination during a meeting convened within 10 working days of learning of the gross misconduct or ethical violations, determining that the above processes (a, b, or c) have not adequately rectified the problem, or during the regularly-scheduled monthly Training Committee meeting, whichever occurs first. Each training site will receive one vote. The TD may decide to temporarily suspend an intern’s clinical activities during this period prior to a final decision being made, if warranted. In the event of dismissal, APPIC and the Director of Clinical Training at the intern’s home doctoral program would be contacted.</li>\r\n</ol>\r\n\r\n<h2>Appeals Process</h2>\r\n\r\n<p>If the intern wishes to challenge the decisions made, he or she may request an Appeals Hearing before the Training Committee. This request must be made in writing- an email will suffice- to the TD within 10 working days of notification regarding the decision made in step 3 or 4 above. If requested, the Appeals Hearing will be conducted by a review panel convened by the TD and consisting of the TD (or another supervisor, if appropriate), the intern’s primary supervisor, and at least two other members of the Training Committee. The intern may request a specific member of the Training Committee to serve on the review panel. The Appeals Hearing will be held within 10 working days of the intern’s request. The review panel will review all written materials and have an opportunity to interview the parties involved or any other individuals with relevant information. The review panel may uphold the decisions made previously or may modify them. The review panel has final discretion regarding outcome.</p>\r\n\r\n<h2>Notifying the Sponsoring Doctoral Program</h2>\r\n\r\n<p>If either the Acknowledgment Notice or the Probation action occurs, the TD will inform the intern\'s sponsoring university within 30 days, indicating the nature of the inadequate rating, the rationale for the action, and the action taken by the faculty. The intern shall receive a copy of the letter to the sponsoring university.</p>\r\n\r\n<p>Once the Acknowledgment Notice or Probation is issued by the TD, it is expected that the status of the problem or inadequate rating will be reviewed no later than the next formal evaluation period or, in the case of probation, no later than the time limits identified in the probation statement. If the problem has been rectified to the satisfaction of the faculty and the intern, the sponsoring university and other appropriate individuals will be informed and no further action will be taken.</p>\r\n\r\n<h2>Grievance</h2>\r\n\r\n<p><strong>Grievance Procedures: </strong>These guidelines are intended to provide the psychology intern with a means to resolve perceived conflicts. Interns who pursue grievances in good faith will not experience any adverse professional consequences. For situations in which an intern raises a grievance about a supervisor, staff member, trainee, or the internship program:</p>\r\n\r\n<h2>Informal Review</h2>\r\n\r\n<p>First, the intern should raise the issue as soon as feasible with the involved supervisor, staff member, other trainee, or TD to informally resolve the problem.</p>\r\n\r\n<h2>Formal Review</h2>\r\n\r\n<p>If the matter cannot be satisfactorily resolved using informal means, the intern may submit a formal grievance in writing to the TD. If the TD is the object of the grievance, the grievance should be submitted to a Site Director. The individual being grieved will be asked to submit a response in writing within 5 working days of receiving the formal grievance. The TD (or other Site Director, if appropriate) will meet with the intern and the individual being grieved within 10 working days. In some cases, the TD or other Site Director may wish to meet with the intern and the individual being grieved separately first. The goal of the joint meeting will be to develop a plan of action to resolve the matter. The plan of action will include:</p>\r\n\r\n<ol type=\"a\">\r\n	<li>the behavior associated with the grievance;</li>\r\n	<li>&nbsp;the specific steps to rectify the problem; and,</li>\r\n	<li>&nbsp;procedures designed to ascertain whether the problem has been appropriately rectified.</li>\r\n</ol>\r\n\r\n<p>The TD or other Site Director will document the process and outcome of the meeting. The intern and the individual being grieved will be asked to report back to the TD or other Site Director in writing within 10 working days regarding whether the issue has been adequately resolved.</p>\r\n\r\n<p>In situations where the nature of the grievance constitutes a potential violation of the subject of the grievance’s contract with his or her employer agency, the employer agency will be notified in accordance with the policies and procedures of the agency.</p>\r\n\r\n<p>If the plan of action fails, the TD or other Site Director will convene a review panel consisting of him/herself and at least two other members of the Training Committee within 10 working days. The intern may request a specific member of the Training Committee to serve on the review panel. The review panel will review all written materials and have an opportunity to interview the parties involved or any other individuals with relevant information. The review panel has final discretion regarding outcome.</p>\r\n\r\n<p>If the review panel determines that a grievance against an individual cannot be resolved internally or is not appropriate to be resolved internally, then the issue will be turned over to the employer agency of the subject of the grievance to initiate the due process procedures outlined in his or her employment contract. If the review panel determines that the grievance against the individual does not constitute a violation of his or her employment contract and can potentially be resolved internally, the review panel will develop a second action plan that includes the same components as above. The process and outcome of the panel meeting will be documented by the TD and the other Site Director. The intern and the individual being grieved will be asked to report in writing to the TD or other Site Director regarding whether the issue has been adequately resolved within 10 working days. The panel will reconvene within 10 working days of receiving the intern’s and individual’s report to again review written documentation and determine whether the issue has been adequately resolved. If the issue is not resolved by the second meeting of the panel, the issue will be turned over to the employer agency to initiate the due process procedures outlined in the employment contract.</p>\r\n','','full_html'),('node','page',0,28,28,'und',0,'<p>The Nevada Psychology Internship Consortium (NV-PIC) requires that interns demonstrate minimum levels of achievement across all training elements, as outlined in the NV-PIC Training Competencies. Interns are expected to achieve an intermediate to advanced level of skill on each element and competency by the conclusion of the internship year. Interns are formally evaluated by their primary supervisor 3-months into the internship year (approximately November), 7-months into internship (approximately March), and at the conclusion of internship year (approximately July). Evaluations are conducted using a standard rating form, which includes comment spaces where supervisors include specific written feedback regarding the interns’ performance and progress. The evaluation form includes information about the interns’ performance regarding all of NV-PIC’s expected training competencies. Supervisors review these evaluations with the interns at each time interval and provide an opportunity for discussion if the intern has questions or concerns about the feedback.</p>\r\n\r\n<p>A minimum level of achievement on each evaluation is defined as a rating of “3” for each training element. The rating scale for each evaluation is a 6-point Likert scale, with the following rating values:</p>\r\n\r\n<ul>\r\n	<li>0=Unsatisfactory/Fail</li>\r\n	<li>1=Needing Improvement</li>\r\n	<li>2=Beginner</li>\r\n	<li>3=Intermediate</li>\r\n	<li>4=Proficient</li>\r\n	<li>5=Advanced</li>\r\n</ul>\r\n\r\n<p>On the first formal evaluation (3-months), a score of 2 on any competency or training element will result in close monitoring by program supervisors. A score of 1 on any competency or training element in the first evaluation will initiate the program’s Due Process procedures. If an intern receives a score less than 3 on any competency or training element on the second formal evaluation (7-months), or if supervisors have reason to be concerned about the student’s performance or progress, the program’s Due Process procedures will be initiated. The Due Process guidelines can be found on<a href=\"/\"> </a><a href=\"http://www.nv-pic.org\">www.nv-pic.org</a> and in the Intern Handbook. Interns are expected to achieve an intermediate to advanced level of skill on each element and competency by the conclusion of the internship year. Thus, all interns must receive a rating of 3 or above on all training elements, profession wide competencies, and program specific competencies by the final evaluation to complete the program successfully.</p>\r\n\r\n<p>Additionally, all NV-PIC interns are expected to complete 2000 hours of training during the internship year. Meeting the hours requirement, attending required training experiences (e.g., didactic seminars), and obtaining sufficient ratings on all evaluations demonstrates that the intern has progressed satisfactorily through and completed the internship program. Feedback to the interns’ home doctoral program is provided at or near the mid-point and the culmination of the internship year. Doctoral programs are contacted within one month following the end of the internship year and informed that the intern has successfully completed the program. If successful completion of the program comes into question at any point during the internship year, or if an intern enters into the formal review step of the Due Process procedures due to a grievance by a supervisor or an inadequate rating on an evaluation, the home doctoral program also will be contacted within 30 days. This contact is intended to ensure that the home doctoral program, which also has a vested interest in the intern’s progress, is kept engaged in order to support an intern who may be having difficulties during the internship year. The home doctoral program is notified of any further action that may be taken by NV-PIC as a result of the Due Process procedures, up to and including termination from the program.</p>\r\n\r\n<p>In addition to the evaluations described above, interns will complete a self-evaluation form three times during the internship year. Interns complete a self-evaluation at the beginning of the internship year, 7-months into internship (March), and at the conclusion of the internship year. Additionally, interns will complete an evaluation of their supervisor and a program evaluation concurrent with the evaluations done by their supervisors (November, March, and July) in order to provide feedback that will inform any changes or improvements in the training program. All evaluation forms can be located on <a href=\"http://www.nv-pic.org\">www.nv-pic.org</a> and in the Intern Handbook.</p>\r\n\r\n<p>Information about interns’ training experiences, evaluations, and certificates of completion are maintained in a secure digital location by the Training Director for future reference and credentialing purposes.</p>\r\n\r\n<p>&nbsp;</p>\r\n','','filtered_html'),('node','page',0,29,29,'und',0,'<p>The annual internship stipend across all consortium sites is $28,000. Interns are employed by the Western Interstate Commission for Higher Education (WICHE). WICHE is an intergovernmental organization which provides consultation to NV-PIC and serves as the fiscal agent for the internship.&nbsp; Health benefits, annual vacation, professional, and sick leave are provided for all interns. In addition, interns receive eleven paid Nevada state holidays. Please see the state Holiday calendar for dates. Questions regarding specific benefits packages can be directed to WICHE’s Human Resources department (Email: <a href=\"mailto:ttorline@wiche.edu\">ttorline@wiche.edu</a>; Telephone: 303-541-0292).</p>\r\n\r\n<p>Interns are non-exempt employees and will be paid an hourly rate. Interns are expected to complete all training experiences within a 40-hour workweek. Prior approval is required for overtime; in almost all circumstances, approval for overtime will not be granted. Interns will submit timesheets to WICHE on a biweekly basis. Please see the Intern Payroll Schedule for more information.</p>\r\n\r\n<p>Interns receive 10 days (80 hours) of Paid Time Off (PTO) and 11 paid Nevada state holidays during the internship year. Additionally, interns are eligible for up to 3 days (24 hours) of Professional Development Release Time, which can include conferences, trainings, dissertation time, or other, as approved by supervisors. Travel time is not included; if travel is required for professional development opportunities, it is considered PTO. Interns should submit requests for PTO or Professional Development Release Time to their primary supervisor at least two weeks in advance of the anticipated leave date for approval using the NV-PIC Leave Request Form. The request then will be communicated to the intern’s Site Director and the NV-PIC Training Director. Interns are expected to refrain from making travel arrangements until supervisor approval has been granted for PTO or Professional Development Release Time. Interns are responsible for communicating anticipated absences to all supervisors for whom work will be missed. Sick leave must be communicated to supervisors in the appropriate manner for each site as soon as the intern is physically able to do so. Supervisors are available for any questions related to time off or release time. Any additional time taken off, if necessary, may result in the internship year being extended beyond 12-months.</p>\r\n\r\n<p>NV-PIC interns have access to numerous resources. All interns are provided with office space, a desk, work computer, office phone, voicemail, printers, software, business cards, ID badges, and other basic office supplies. Intervention manuals, assessment materials, other training materials, access to the DSM&nbsp; 5 and ICD-10, and additional materials as needed and approved are provided at each training site, and additional materials that may be needed may be purchased with Training Committee approval. Software for digital scoring of test batteries is available at each site. Funding for travel within the state of Nevada is provided in order for interns to complete required training experiences, and interns have access to state vehicles, if needed, for in-state travel. In addition to weekly didactic seminars and other professional trainings, interns have access to a limited number of online academic journals through the Division of Public and Behavioral Health (DPBH) intranet. Each intern has access to administrative and IT support.</p>\r\n\r\n<p>&nbsp;</p>\r\n','','filtered_html'),('node','page',0,30,30,'und',0,'<p>Attendance at weekly Didactic seminars, Group Supervision, and the Peer Professional Development Group is mandatory for all interns in the Nevada Psychology Internship Consortium (NV-PIC) and required for successful completion of the internship. Attendance at these scheduled activities takes priority over other site obligations. Unless otherwise noted, Didactic seminars are held on Tuesdays from 8:30-10:30am. Peer Professional Development Group is held on Tuesdays from 11:00am-12:00pm. Group Supervision is held on Wednesdays from 8:30-10:30am. All supervisors are aware of these activities and the attendance requirement for interns.</p>\r\n\r\n<p>Attendance at Didactic seminars, Group Supervision, and the Peer Professional Development group occurs via distance-mediated technology. Interns and the group facilitator will participate from their respective office computers over a HIPAA-compliant, secure telecommunications platform. Interns are expected to participate fully and actively in each of these mandatory activities; interns should not be checking email, surfing the internet, completing notes, or doing other computer-related or non-relevant activities during Didactic seminars, Group Supervision, or Peer Professional Development Group.</p>\r\n\r\n<p>The Training Director must be notified in advance of scheduled PTO or Professional Development Release time that will require missing a mandatory training activity. If an intern misses a Didactic seminar, Group Supervision, or Peer Professional Development Group meeting because of a serious emergency or for a serious illness, he or she should alert the group facilitator and the Training Director as soon as possible. Attendance at each Didactic seminar, Group Supervision, and Peer Professional Development Group meeting is tracked by NV-PIC, and absences are reported to the Training Director.</p>\r\n\r\n<p>Attendance at didactics is tracked via completion of a didactic evaluation form; interns who do not complete an evaluation form will be considered as having missed the didactic. Interns who miss more than 3 didactic seminars may be required to work with their supervisor to come up with a plan to make up for missed learning experiences.</p>\r\n\r\n<p>Attendance at Group Supervision and Peer Professional Development Group is tracked by the group facilitators; all absences are reported to the Training Director. Missing more than three sessions of Group Supervision or Peer Professional Development Group will be dealt with on a case-by-case basis and an appropriate response will be determined. Unexcused absences from mandatory training activities may result in initiating the NV-PIC Due Process procedures.</p>\r\n\r\n<p>&nbsp;</p>\r\n','','filtered_html'),('node','page',0,31,31,'und',0,'<p>The Nevada Psychology Internship Consortium (NV-PIC) uses videoconferencing to provide weekly group supervision to all interns. This format is utilized in order to promote interaction and socialization among interns and faculty. Interns and faculty meet in a virtual conference room and interact via high-quality real-time transmission of simultaneous video and audio. Group Supervision in this format is required for all current NV-PIC interns for two hours each week, at a regularly scheduled time, in addition to a required facilitated Peer Professional Development Group in this format for one hour each week, at a regularly scheduled time, as well as didactic opportunities in this format for two hours each week. Group supervision is led by a member of the NV-PIC training faculty; the facilitated Peer Professional Development Group is led by a licensed psychologist who is not a member of the Training Committee in order to allow interns the opportunity to process and consult among themselves but still with the supervision and facilitation of a licensed psychologist. NV-PIC places high value on cohesion and socialization of intern cohorts, and virtual meetings via videoconferencing are an effective way to foster connection during the intervals between in-person meetings. The use of videoconference technology for supervisory experiences is consistent with NV-PIC’s model and training philosophy as NV-PIC places a strong training emphasis on access to behavioral healthcare, which often includes the use of telehealth services.</p>\r\n\r\n<p>NV-PIC recognizes the importance of supervisory relationships. Group Supervision is led by a member of the core NV-PIC training faculty in order to provide interns with the opportunity to experience a breadth of supervisory relationships and supervision modalities. The facilitation of the Peer Professional Development Group by a licensed psychologist who is not a member of the Training Committee also allows interns to experience a breadth of supervisory relationships. Given the geographical distance between training sites, this model allows the interns to form greater connection to the training faculty and licensed psychologists in Nevada than would be experienced otherwise. It is expected that the foundation for these supervisory relationships will be cultivated initially during NV-PIC’s orientation, such that interns will have formed relationships with the training faculty prior to engaging in videoconference Group Supervision and Peer Professional Development. For all clinical cases discussed during Group Supervision, full professional responsibility remains with the intern’s primary supervisor, and any crises or other time-sensitive issues are reported to that supervisor immediately. Interns are provided contact information for all NV-PIC supervisors including email and phone numbers, so crises and time-sensitive information can be reported as necessary.</p>\r\n\r\n<p>All NV-PIC videoconferencing occurs over a secure network using State-administered technology. Supervision sessions using this technology are never recorded, thus protecting the privacy and confidentiality of all trainees. All interns are provided with instruction regarding the use of the videoconferencing equipment at the outset of the training year. Technical difficulties that cannot be resolved on site are directed to the Office of Information Technology (OIT) Help Desk.</p>\r\n\r\n<p>&nbsp;</p>\r\n','','filtered_html'),('node','page',0,32,32,'und',0,'<p>The Nevada Psychology Internship Consortium (NV-PIC) social media policy applies to all NV-PIC interns regarding the use of social media with clients and NV-PIC faculty. Unless otherwise mentioned, this policy applies specifically to the use of social media and does not include the use of text message, voicemail, email, or other forms of technology.</p>\r\n\r\n<p>Interns will not use social media or other internet-based tools (e.g., googling) to interact with or look-up client information, unless the intern receives prior approval from his or her supervisor. If requested to look at a social media site (e.g., Facebook profile) by a client, interns will use their judgment about the clinical utility of doing so and will do so only on the client’s device during the therapy session. Interns are permitted to look up client information regarding legal charges on law enforcement or government websites.</p>\r\n\r\n<p>Interns should use only state equipment (e.g., office phone) to communicate with clients. Emailing with clients or guardians is generally prohibited as a means of communication. Email contact with clients or guardians may be permissible on rare occasions with approval from the intern’s supervisor.</p>\r\n\r\n<p>It is the policy of NV-PIC that interns will not use social media to interact with members of the Training Committee, supervisors, or other faculty members. Following the completion of internship training, social media contact with NV-PIC training committee members and supervisors is permitted to the extent that interns and faculty members are comfortable and mutually agree to do so.</p>\r\n\r\n<p>Interns are encouraged to review the security settings of all social media sites and profiles to ensure they understand what information about themselves is publically available. If an intern has questions related to information contained within this policy or about security settings of social media sites, he or she is encouraged to speak with his or her primary supervisor or the NV-PIC Training Director.</p>\r\n','','filtered_html'),('node','page',0,33,33,'und',0,'<ul>\r\n	<li><strong>Family &amp; Medical Leave:</strong> WICHE provides interns with up to 12 work weeks of unpaid, job-protected leave within a 12-month period and provides health benefits during the leave (up to 12 weeks). Unpaid leave may be granted in the following circumstances: intern serious health condition*, pregnancy-related disability, father’s attendance at birth of child, parent’s care of newborn, if completed within 12 months following birth of child, placement of a child with intern for adoption or foster care, serious health condition of intern’s child under 18 years, or older child if disabled, or serious health condition of intern’s spouse or parent.<br />\r\n	&nbsp;</li>\r\n	<li><strong>Requesting Leave:</strong> Whenever possible, interns must notify WICHE Human Resources at least 30 days prior to the leave of absence. Requests for leave should be made in writing to Human Resources, stating the reason for the leave, the starting date, and the planned date for return to work.<br />\r\n	&nbsp;</li>\r\n	<li><strong>Disability Insurance:</strong> During parental leave, interns may be granted up to 6 weeks (for vaginal delivery) or up to 8 weeks (for C-section delivery) of temporary disability insurance payment. This amounts to 60% of average weekly wages during the designated time period. Disability payments for other types of medical leave are also paid at 60% and length of disability payments vary depending on the medical condition and when the doctor releases the patient to return to work.&nbsp; A maximum of 173 days is allowed under the short-term disability insurance plan.&nbsp;<br />\r\n	&nbsp;</li>\r\n	<li><strong>Health Insurance: </strong>If an intern is currently covered by WICHE’s insurance plans, these benefits continue for interns on family or medical leave. WICHE will pay for intern (and any eligible dependents’) insurance premiums while on unpaid leave. If the intern is able, but does not return to work after the expiration of the leave, the intern will be required to reimburse WICHE for payment of insurance premiums during the leave. Children may be added to the intern’s health insurance policy if coverage is elected within 30 days of the birth or adoption. Children also can be added to the intern’s health insurance within 30 days of the date of birth or 30 days of another qualifying event such as loss of coverage. Please contact Human Resources for more information.<br />\r\n	&nbsp;</li>\r\n	<li><strong>Return to Work:</strong> Interns must contact WICHE Human Resources at least two days before their first day of return from leave. If the leave is for an intern’s own serious health condition, the intern must provide medical certification verifying ability to return to work. Failure to return to work on the day after the expiration of leave may result in termination of employment.&nbsp; If the intern is unable to return to work, the intern must provide medical certification no less than two days before the anticipated return date.<br />\r\n	&nbsp;</li>\r\n	<li><strong>Hours Supplementation:</strong> Interns are required to complete a 12-month, 2000-hour internship. The number of workdays taken off during a leave of absence will be added as an extension to the training year. The intern should work closely with their site supervisor and the NV-PIC Training Director to develop a plan to complete all required training experiences upon return from leave. The timeline for evaluations will be adjusted on a case-by-case basis; upon return from leave, the NV-PIC Training Director, the site supervisor, and the intern will agree on a timeline for when formal evaluations will occur. The intern must complete the full 12 months of training, achieve 2000 training hours, and receive satisfactory ratings on the final Intern Evaluation Form in order to complete the internship.<br />\r\n	&nbsp;</li>\r\n	<li><strong>Maximum Length:</strong> Interns must complete all requirements for completion of the internship no later than 18 months after the start of the internship. Interns who take up to&nbsp;12-weeks of family/medical leave are&nbsp;still eligible for the full amount of the NV-PIC stipend as long as they&nbsp;complete 2000 hours of internship work within 18-months of the internship start date.</li>\r\n</ul>\r\n\r\n<p>*A serious health condition is defined as follows (§825.113):</p>\r\n\r\n<ol type=\"a\">\r\n	<li>For purposes of FMLA, serious health condition entitling an employee to FMLA leave means an illness, injury, impairment or physical or mental condition that involves inpatient care as defined in §825.114 or continuing treatment by a health care provider as defined in §825.115.<br />\r\n	&nbsp;</li>\r\n	<li>&nbsp;The term incapacity means inability to work, attend school or perform other regular daily activities due to the serious health condition, treatment therefore, or recovery therefrom.<br />\r\n	&nbsp;</li>\r\n	<li>The term treatment includes (but is not limited to) examinations to determine if a serious health condition exists and evaluations of the condition. Treatment does not include routine physical examinations, eye examinations, or dental examinations. A regimen of continuing treatment includes, for example, a course of prescription medication (e.g., an antibiotic) or therapy requiring special equipment to resolve or alleviate the health condition (e.g., oxygen). A regimen of continuing treatment that includes the taking of over-the-counter medications such as aspirin, antihistamines, or salves; or bed-rest, drinking fluids, exercise, and other similar activities that can be initiated without a visit to a health care provider, is not, by itself, sufficient to constitute a regimen of continuing treatment for purposes of FMLA leave.<br />\r\n	&nbsp;</li>\r\n	<li>Conditions for which cosmetic treatments are administered (such as most treatments for acne or plastic surgery) are not serious health conditions unless inpatient hospital care is required or unless complications develop. Ordinarily, unless complications arise, the common cold, the flu, ear aches, upset stomach, minor ulcers, headaches other than migraine, routine dental or orthodontia problems, periodontal disease, etc., are examples of conditions that do not meet the definition of a serious health condition and do not qualify for FMLA leave. Restorative dental or plastic surgery after an injury or removal of cancerous growths are serious health conditions provided all the other conditions of this regulation are met. Mental illness or allergies may be serious health conditions, but only if all the conditions of this section are met.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n','','full_html'),('node','page',0,34,34,'und',0,'<h2>General Requirements</h2>\r\n\r\n<ol>\r\n	<li>Complete a monthly hours training log documenting hours of training during the internship year</li>\r\n	<li>Complete the following evaluations at the following time-points:\r\n	<ul>\r\n		<li>Self-evaluation: beginning of internship, 7-months, and end of internship year</li>\r\n		<li>Program evaluation: 3-months, 7-months, and end of internship year</li>\r\n		<li>Supervisor evaluation: 3-months, 7-months, and end of internship year</li>\r\n		<li>Didactic evaluations: following each didactic</li>\r\n	</ul>\r\n	</li>\r\n	<li>Achieve a “3” on all required competencies on supervisor evaluation of intern by end of internship year</li>\r\n</ol>\r\n\r\n<h2>Clinical Requirements</h2>\r\n\r\n<ol>\r\n	<li>Complete 2000 hours of training during the internship year, as documented on the hours training log</li>\r\n	<li>Complete 500 hours of direct face-to-face service provision, as documented on the hours training log</li>\r\n	<li>Complete site required training in behavioral health intervention, psychological assessment, and consultation and systems collaboration</li>\r\n	<li>Complete all site-specific training requirements and associated clinical documentation</li>\r\n</ol>\r\n\r\n<h2>Supervision and Training Requirements</h2>\r\n\r\n<ol>\r\n	<li>Attend 2 hours per week of individual supervision at site</li>\r\n	<li>Attend 2 hours per week of NV-PIC group supervision</li>\r\n	<li>Attend 2 hours per week of NV-PIC didactic seminars</li>\r\n	<li>Attend 1 hour per week of NV-PIC Peer Professional Development Group</li>\r\n	<li>Complete NV-PIC required research project</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n','','filtered_html'),('node','page',0,35,35,'und',0,'<p><em>Date Program Tables are updated: September 1</em></p>\r\n\r\n<h2>Internship Program Admissions</h2>\r\n\r\n<p><em>Briefly describe in narrative form important information to assist potential applicants in assessing their likely fit with your program. This description must be consistent with the program’s policies on intern selection and practicum and academic preparation requirements:</em></p>\r\n\r\n<p>NV-PIC bases its selection process on a holistic review of the potential intern’s application, including the AAPI, cover letter, CV, standardized reference forms, graduate transcripts, and writing sample. Applicants with a minimum of 500 intervention hours, experience with assessment, and who have defended their dissertation proposal are preferred. In addition, NV-PIC prefers applicants who have some experience or special interest in working with underserved or diverse populations. NV-PIC takes into consideration the interest of any prospective intern to remain in Nevada following internship, as developing a strong behavioral health workforce is an important consideration for the state.</p>\r\n\r\n<h3>Total Direct Contact Assessment Hours</h3>\r\n\r\n<table border=\"0\" class=\"nv-pic\">\r\n	<caption><strong>Does the program require that applicants have received a minimum number of hours<br />\r\n	of the following at time of application?<br />\r\n	If Yes, indicate how many:</strong></caption>\r\n	<tbody>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th scope=\"col\">Yes</th>\r\n			<th scope=\"col\">No</th>\r\n			<th scope=\"col\">Amount</th>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Total Direct Contact Intervention Hours</th>\r\n			<td>&nbsp;</td>\r\n			<td><strong>N</strong></td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Total Direct Contact Assessment Hours</th>\r\n			<td>&nbsp;</td>\r\n			<td><strong>N</strong></td>\r\n			<td scope=\"row\">&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<h3><em>Describe any other required minimum criteria used to screen applicants:</em></h3>\r\n\r\n<p>NV-PIC prefers applicants who have at least 500 intervention hours and some experience with assessment, but NV-PIC does not have any minimum requirements or “screen-out” criteria.</p>\r\n\r\n<h3>Financial and Other Benefit Support for Upcoming Training Year <a href=\"#footnote-1\"><sup>1</sup></a></h3>\r\n\r\n<table border=\"0\" class=\"nv-pic\">\r\n	<tbody>\r\n		<tr>\r\n			<th colspan=\"2\" scope=\"row\">Annual Stipend/Salary for Full-time Interns</th>\r\n			<td>$28,000</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\"2\" scope=\"row\">Annual Stipend/Salary for Half-time Interns</th>\r\n			<td>N/A</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th scope=\"col\">Yes</th>\r\n			<th scope=\"col\">No</th>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Program provides access to medical insurance for intern</th>\r\n			<td>Yes</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th colspan=\"3\" scope=\"col\">if access to medical insurance is provided</th>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Trainee contribution to cost required?</th>\r\n			<td>&nbsp;</td>\r\n			<td>No</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Coverage of family member(s) available?</th>\r\n			<td>Yes</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Coverage of legally married partner available?</th>\r\n			<td>Yes</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Coverage of domestic partner available?</th>\r\n			<td>Yes</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><strong>Hours of Annual Paid Personal Time off (PTO and/or Vacation)</strong>: 80 hours</p>\r\n\r\n<p><strong>Hours of Annual Paid Sick Leave:</strong> N/A – NV-PIC provides 10 days (80 hours) of PTO total, inclusive of vacation and sick time.</p>\r\n\r\n<p><strong>In the event of medical conditions and/or family needs that require extended leave, does the program allow reasonable unpaid leave to interns/residents in excess of personal time off and sick leave?&nbsp;</strong>Yes&nbsp;</p>\r\n\r\n<h2>Other Benefits (please describe):</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><b>Initial Post-Internship Positions</b></p>\r\n\r\n<p>(Aggregated Tally for Preceding 3 cohorts)<strong> <a href=\"#footnote-2\"><sup>2</sup></a></strong></p>\r\n\r\n<table class=\"nv-pic\">\r\n	<caption>Date Range: 2015-16 to 2016-17</caption>\r\n	<tbody>\r\n		<tr>\r\n			<th scope=\"row\">Total # of interns who were in the 3 cohorts:</th>\r\n			<td colspan=\"2\">8</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Total # of interns who did not seek employment because they returned to their doctoral program/are completing doctoral degree</th>\r\n			<td colspan=\"2\">0</td>\r\n		</tr>\r\n		<tr>\r\n			<th>&nbsp;</th>\r\n			<th scope=\"col\">PD</th>\r\n			<th scope=\"col\">EP</th>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Community mental health center</th>\r\n			<td>&nbsp;</td>\r\n			<td>1</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Federally qualified health center</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Independent primary care facility/clinic</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">University counseling center</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Veterans Affairs medical center</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Military health center</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Academic health center</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Other medical center or hospital</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Psychiatric hospital</th>\r\n			<td>2</td>\r\n			<td>2</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Academic university/department</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Community college or other teaching setting</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Independent research institution</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Correctional facility</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">School district/system</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Independent practice setting</th>\r\n			<td>2</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Not currently employed</th>\r\n			<td>1</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Changed to another field</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Other</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">Unknown</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<th scope=\"row\">&nbsp;</th>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><a name=\"footnote-1\"></a></p>\r\n\r\n<p><sup>1</sup> Note. Programs are not required by the Commission on Accreditation to provide all benefits listed in this table.</p>\r\n\r\n<p><a name=\"footnote-2\"></a></p>\r\n\r\n<p><sup>2</sup> Note: “PD” = Post-doctoral residency position; “EP” = Employed Position. Each individual represented in this table should be counted only one time. For former trainees working in more than one setting, select the setting that represents their primary position.</p>\r\n','','full_html');
