INSERT INTO `copicsearch_dataset` VALUES (1,'node',' welcome to the nvpic web site we are participating in phase ii of the match southern nevada adult mental health services snamhs has 2 open positions 1 for the general track and 1 for the forensic track we will be following all appic procedures for phase ii see below for additional information general information the nevada psychology internship consortium nvpic represents the collaborative effort of three sites within one state agency the nevada division of public and behavioral health dpbh to share resources and faculty for the purpose of providing a diversified educational program for psychology interns nvpic offers a oneyear fulltime doctoral internship beginning and ending in august each year the 4digit general appic program code for nvpic is  2323  training takes place at 3 training sites in or around the renosparks area las vegas and carson city the consortium sites are  northern nevada adult mental health services nnamhs   the appic program code for nnamhs is  232313  carson city rural clinic ccrc   the appic program code for ccrc is  232314  southern nevada adult mental health services snamhs   snamhs offers two internship tracks a clinicalgeneral track and a clinicalforensic track the tracks are described further in the nvpic brochure below and on the snamhs  page the appic program code for snamhs general track is  232312  the appic program code for snamhs forensic track is  232315  click here to download the nvpic internship brochure   20182019 brochure applying to nvpic the consortium currently offers 4 fulltime internship positions  applicants may apply to as many sites within the consortium as they wish each consortium site has its own unique match number including a unique match number for each track at snamhs so applicants are able to rank sites or tracks according to their preference nvpic participates in appic s online aapi procedure please visit wwwappicorg for more information about the process and to submit an online application applications for the 20182019 internship year are due by december 5 2017  applicants will be notified regarding their interview status on or before december 15 please see the  application procedures  page for more information contacting nvpic questions regarding nvpic or the application and interview process may be directed to nvpic s dr emily slife incoming training director for 201819  eslife healthnvgov  702 4860711 sitespecific information also can be directed to the site directors whose contact information can be found on the nvpic faculty  page accreditation status nvpic has been accredited on contingency by the american psychological association since may 18 2017 questions related to the program s accreditation status should be directed to the commission on accreditation  office of program consultation and accreditation american psychological association 750 1st street ne washington dc 20002 phone 202 3365979 email  apaaccred apaorg nvpic is a proud member of appic and participates in the appic match 2323 this internship site agrees to abide by the appic policy that no person at this training facility will solicit accept or use any rankingrelated information from any intern applicant member information through the appic online directory can be found here    ',0),(2,'node',' mission philosophy mission philosophy ',0),(3,'node',' nvpic training sites nvpic includes the following training sites  northern nevada adult mental health services nnamhs  carson city rural clinic ccrc  southern nevada adult mental health services snamhs  northern nevada adult mental health services  nnamhs  and carson city rural clinic  ccrc  each will accept one 1 fulltime internship position for the 20182019 cohort southern nevada adult mental health services  snamhs  will accept two 2 fulltime internship positions for the 20182019 cohort one 1 for the clinicalgeneralist track and one 1 for the clinicalforensic track a description of each site and the internship experience by site is located on the pages for each site linked to above contact information for each site is located on the nvpic  faculty  page  ',0),(4,'node',' training emphases required major training emphases all sites offer major training emphases in behavioral health intervention psychological assessment and consultation and systems collaboration behavioral health intervention each consortium site provides opportunities for interns to conduct behavioral health intervention in an inpatient and or outpatient settings all sites provide interns the chance to work with a diverse range of underserved clients within a variety of therapeutic modalities individual and group therapy treatments with adult clients are most common across agencies with opportunities to work with children and families available at some interns working in inpatient settings have the opportunity to provide individual brief intervention services behavioral support intervention plans group treatment and individualized token economy plans clients served across sites range widely in age race ethnicity and diagnostic presentation  psychological assessment interns at every site administer interpret and provide written synthesis of psychological test batteries assessments may include record reviews clinical interviews intellectual achievement personality and or competencybased measures the referral questions and types of assessments differ and may include differential diagnosis risk assessment or malingering interns have opportunities to write reports and make recommendations that convey meaningful information to clients while each site varies on the number and type of referrals interns complete a minimum of 10 assessments throughout the course of the year consultation and systems collaboration interns spend time each week in activities related to consultation and systems collaboration learning to contribute their clinical work within an interdisciplinary team across agencies and to other systems collaborative opportunities include working within an interdisciplinary treatment team providing psychological consultation to other disciplines and partnering with community social service legal and educational systems    ',0),(5,'node',' supervision didactics and additional training experiences supervision interns receive a minimum of 2 hours of individual supervision each week from a licensed psychologist at their site supplemental weekly individual supervision may be provided by other faculty at each site or other partnering sites licensed supervisors provide interns with experientially based clinical training all nvpic interns will be observed directly either live or electronic by at least one supervisor during each evaluation time period audio recordings and written process recordings also may be utilized by nvpic supervisors two hours of required weekly group supervision from a licensed psychologist is conducted with all interns across consortium sites via highquality secure distance technology group supervision focuses on case presentation supervision topicfocused discussion internled didactics and professional development all interns receive a minimum of 4 hours of supervision per week didactic seminars and case conferences opportunities to attend didactic activities such as case conferences staff development trainings and treatment team meetings vary across internship sites all interns attend weekly didactic seminars as a group via distance technology topics for didactic seminars may include professional ethics and nevada legal issues cooccuring treatment chronic illness management integrated care competency evaluations malingering evidence based practice for seriously mentally ill dialectical behavior therapy dbt acceptance and commitment therapy act sex offender assessment child and family interventions personality disorders intervention psychopharmacology benefits and risks working with lgbtq developmental disorders research research opportunities vary by consortium site each intern is expected to complete at least one research or program evaluation project during the year as approved by their primary supervisor the research project includes a literature review and quantitative qualitative or archival data analysis the focus of the research project is specific to public behavioral health and includes a proposal for a programmatic addition or change to enhance service delivery professional development interns spend 1 hour per week in a facilitated peer professional development group ppdg which they attend via highquality secure distance technology this meeting which includes all interns and a licensed psychologist focuses on promoting personal and professional development within and between interns working in the three internship sites throughout nevada interns can use the group to explore a variety of work related issues personal and professional development are fostered through discussion of one s hopes expectations and experiences within the internship information insights and observations offered by group members to other members and individual members observing listening and participating in the group process the function of the group is to provide interns with support opportunities to learn grow apply what they ve learned in their work with patients and share it with colleagues the ppdg functions like a classroom and a laboratory it allows interns to learn with and from each other experiment take healthy risks and test ideas the ppdg also allows interns to share and explore thoughts and feelings about themselves their patients and the demands of their work the ppdg provides a forum for interns to debrief the multitude of experiences good bad and ugly that occur during the course of their internship education and training it also allows interns to give and receive feedback about each other s interpersonal impact communication style and personal and professional strengths and weaknesses in sum the group is a place to give and receive support and to learn and grow in a group setting that allows each individual to recognize and develop underdeveloped levels of awareness skills and abilities  ',0),(6,'node',' nvpic competencies the nevada psychology internship consortium nvpic represents the collaborative effort of three behavioral health agencies within the nevada division of public and behavioral health to share resources and faculty for the purpose of providing a broad and general educational program for psychology interns by the conclusion of the internship year nvpic interns are expected to have achieved competence in the following areas  research ethical and legal standards individual and cultural diversity professional values attitudes and behaviors communication and interpersonal skills assessment intervention supervision consultation and interprofessional interdisciplinary skills public behavioral health for further information on nvpic s aims competencies and training elements please see nvpic s aims and competencies   ',0),(7,'node',' intern expectations please visit the following pages to learn more about expectations of interns and what interns can expect from nvpic  general expectations life in nevada stipends benefits and resources internship competencies ',0),(8,'node',' stipends and benefits stipends benefits and resources the annual internship stipend across all consortium sites is 28000 interns are employed by the western interstate commission for higher education  wiche  wiche is an intergovernmental organization which provides consultation and technical assistance to the nvpic program and serves as the fiscal agent for the internship health benefits annual vacation professional and sick leave is provided for all interns interns receive 10 days 80 hours of paid time off pto during the course of the internship year additionally interns are eligible for up to 3 days 24 hours of professional development release time which can include conferences trainings dissertation time or other as approved by supervisors in addition interns receive eleven paid nevada state holidays nvpic interns have access to numerous resources all interns are provided with office space a desk work computer office phone voicemail printers software business cards id badges and other basic office supplies intervention manuals assessment materials other training materials access to the dsm5 and icd10 and additional materials as needed and approved are provided at each training site and additional materials that may be needed may be purchased with training committee approval software for digital scoring of test batteries is available at each site funding for travel within the state of nevada is provided in order for interns to complete required training experiences in addition to weekly didactic seminars and other professional trainings interns have access to monthly grand rounds provided by the university of nevadareno unr and to a limited number of online academic journals through the division of public and behavioral health dpbh intranet each intern has access to administrative and it support  ',0),(9,'node',' life in nevada nevada area attractions nvpic is a consortium program with sites across the diverse landscapes and cultures of nevada interns are placed at one site for the full internship year but have the opportunity to travel and experience the diverse and unique ecosystems of nevada in addition to experiencing the beauty of nevada interns who choose to stay in nevada following internship have opportunities for loan repayment and forgiveness through working in approved  national health service corps nhsc  loan repayment sites or through the public service loan forgiveness pslf program    southern nevada one of our internship sites snamhs is located in the heart of las vegas las vegas is well known for its worldclass entertainment dayspas auto shows nightclubs retail golfing and fine dining this 24hour city offers wildlife habitats fine art and museums dedicated to neon the mob natural history and more recreation within the natural wonders of the nearby nevada desert includes breathtaking landscapes and spectacular rock formations such as red rock canyon in the mohave desert lake mead the valley of fire and mount charleston daytrip destinations include the grand canyon lake havasu the extraterrestrial highway and area 51 mojave national preserve zion national park and dixie national forest     northern nevada two of our internship sites are located in the northern region of the state one in the renosparks area nnamhs and one in carson city ccrc carson city the state capital small in size but big in stature is home to many historical sites close by are lake tahoe to the west virginia city to the east reno to the north and genoa to the south reno the biggest little city in the world is 30 minutes away from carson city and a two to threehour drive from major metro areas in northern california including sacramento and san francisco northern nevada is a yearround recreation destination activities include skiing snowboarding fishing boating hiking wilderness camping mountain biking horseback riding swimming watersports and golf courses area outdoor recreation venues include the truckee river a variety of lakes including beautiful lake tahoe and the mountains known as the sierra nevada lake tahoe has long been considered the jewel of the sierra not only for its contribution to the scenic majesty of the area but also for the adventure that can be found in the region which includes the largest concentration of ski slopes in the united states and endless mountain biking trails including lake tahoe s famous rim trail   statewide attractions and events known for its legal gambling and worldclass casinos nevada has a rich arts and cultural scene as well annual events in las vegas include the city of light jazz festival world series of poker tournament annual academy of country music awards vegas uncork d rock n roll marathon electric daisy carnival motor trend auto show cirque du soleil wrangler national rodeo finals life is beautiful festival unlvino and the word food championships in northern nevada artown in reno includes a month of live music on the river and other venues around town other annual community events include the reno river festival street vibrations hot august nights the great reno balloon race national championship air races best of the west rib cookoff virginia city camel race street vibrations reno rodeo carson valley days festival and the burning man festival held just a few hours east for more information on visiting and living in nevada please visit  http travelnevadacom   ',0),(10,'node',' application procedure application process the consortium currently offers four fulltime positions one position each at nnamhs and ccrc and two positions at snamhs students interested in applying for the internship program should submit an online application through the appic website  wwwappicorg  nvpic is listed in appic under program code 2323 applicants may apply to as many sites within the consortium as they wish each consortium site has its own unique match number so applicants are able to rank sites according to their preference match numbers for the nvpic sites are as follows northern nevada adult mental health services nnamhs 232313 carson city rural clinic ccrc 232314 southern nevada adult mental health services snamhs clincialgeneralist track 232312 southern nevada adult mental health services snamhs clincialforensic track 232315 a complete application consists of the following materials a completed online aapi appic s standard application cover letter part of online aapi stating your preferred training site s and why you are interested in those sites specifically applicants can indicate their interest in more than one site within the consortium in one cover letter a current curriculum vitae part of the online aapi three standardized reference forms at least two of which must come from individuals who have directly supervised your clinical and or research work part of the online aapi official transcripts of all graduate coursework part of the online aapi  supplementary materials  include a writing sample such as an integrated assessment report or a clinical case conceptualization please redact appropriately optional voluntary materiais  interns who match with nvpic are the employees of the western interstate commission for higher education  wiche  it is the policy of wiche to provide equal employment opportunity to all qualified applicants as an affirmative action employer wiche is required to invite all applicants to complete the forms attached here  completion of the forms is voluntary and will not subject you to any adverse treatment the information on these forms is confidential and will be maintained separately from your application if you choose to do so please download this  form  and upload it with your application remember that completion of this form is voluntary and in no way affects the decision regarding your application for employment prospective applicants may contact dr sean dodge  sdodge healthnvgov  or any of the site directors for more information about the nvpic internship applications or the interview procedure application deadline and interview process all application materials must be received by december 1  in order to be considered applicants who are invited to interview will be notified by email on or before december 15 interviews are scheduled in january and will occur either in person or via videoconference phone interviews will be provided in cases where videoconference is not an option applicants are encouraged but not required to visit consortium sites this internship site agrees to abide by the appic policy that no person at this training facility will solicit accept or use any rankingrelated information from any intern applicant selection criteria nvpic bases its selection process on the entire application package noted above however applicants who have met the following qualifications prior to beginning internship are considered preferred current enrollment in goodstanding in a psychology doctoral program a minimum of 500 intervention hours experience with assessment dissertation proposal defended some experience or special interest in working with underserved or diverse populations in addition to the preferences noted above nvpic takes into consideration the potential commitment or interest of any prospective intern to remain in nevada following internship developing a strong behavioral health workforce is an important consideration for the state and an interest in remaining in nevada to join the workforce is considered a benefit in a potential intern postmatch employment requirements all interns who match to nvpic sites must provide proof of eligibility to work in the united states nvpic does not sponsor work visas interns must successfully pass a fingerprintbased background check before beginning employment and must provide results from a tuberculosis tb screening test from the previous 12months instructions for providing this information or completing the background check and tb screening will be sent out to all who match after the match is complete in addition all interns working in nonfederally regulated internship programs in the state of nevada are required to register with the nevada board of psychological examiners information on board registration including cost can be found at  http psyexamnvgov forms psychological    ',0),(11,'node',' policies procedures policies procedures nvpic application process and selection criteria diversity and nondiscrimination policy due process and grievance procedures intern evaluation and record maintenance procedures stipend benefits and resources mandatory training activities attendance policy videoconference supervision policy social media policy family medical leave policy quick reference guide for nvpic minimum training requirements evaluation forms intern evaluation program evaluation supervisor evaluation ',0),(12,'node',' program structure please visit the following pages to learn more about the nvpic doctoral internship program  program structure aim and philosophy training emphases supervision didactics and additional training experiences policies and procedures ',0),(14,'node',' program structure aim and philosophy program structure the consortium offers oneyear fulltime doctoral internships beginning and ending in august the start date for the 20182019 cohort is  august 6 2018  nvpic provides a range of clinical and didactic experiences that represents the necessary depth and breadth required for future professional practice within psychology interns have a primary placement at one of three sites with the possibility of receiving additional training experiences with faculty from other sites within the consortium program aim the aim of the nevada psychology internship consortium nvpic is to prepare and retain high quality and culturally competent psychologists to provide integrated public behavioral health care for the people of nevada program philosophy nvpic trains clinical psychologists who are effective consumers of research and who utilize scholarly inquiry to inform their practice nvpic offers generalist training with the opportunity for specialized training that varies across training sites more information about each training site and the resources and opportunities offered by each is provided under  site descriptions  focus on diversity nevada is a highly diverse state with a large population of underserved individuals nvpic is committed to promoting diversity in its training program which includes an investment and commitment to recruiting and retaining staff at all nvpic sites who represent culturally and individually diverse backgrounds nvpic also is committed to recruiting and retaining interns who represent culturally and individually diverse backgrounds diversity is a core emphasis of the training curriculum and it is woven into every component of the internship which creates a supportive learning and employment environment for our interns and staff individuals interested in applying for staff positions within nvpic s training sites may see the nevada division of public and behavioral health dpbh  employment information  website for information about openings  ',0),(15,'node',' general expectations general expectations the nvpic training program is a yearlong fulltime doctoral internship experience beginning and ending in august the start date for the 20182019 cohort is august 6 2018 across training sites interns are expected to complete 2000 hours of training during the the internship year of which at least 25 500 hours are spent in the provision of direct facetoface clinical services this includes completing an average of 1020 hours per week of facetoface direct service delivery interns are expected to achieve the aims and competencies of the internship program see nvpic competencies  and to abide by the apa code of ethics  the requirements of the nvpic training program and the policies and procedures of their primary training site nvpic strives to be a familyfriendly internship and welcomes interns from all backgrounds with a variety of family structures and needs please contact nvpic s training director should you have any questions nvpic has a comprehensive due process procedure which outlines the procedure for addressing concerns about intern performance as well as interns concerns about training these procedures are provided in hard copy to all interns during orientation and are available for download under  policies and procedures   ',0),(17,'node',' northern nevada adult mental health services nnamhs  please note nnamhs is not an active training site for 20182019   northern nevada adult mental health services nnamhs   fulltime position appic program code 232313 general information  located on the scenic truckee river northern nevada adult mental health services nnamhs provides comprehensive care primarily to individuals with serious behavioral health disorders in northern nevada nnamhs provides inpatient and outpatient services to adults and their families serving over 1600 clients annually inpatient care is provided at the dinitownsend psychiatric hospital which has a 20 bed inpatient unit and an inpatient rapid stabilization unit rsu with a 10 bed capacity several community programs compose the community outpatient services at nnamhs each program focuses on providing behavioral health services to individuals in the community below is a list of community outpatient services available at nnahms medication clinic psychosocial rehabilitation program and peer support programs housing and residential programs psychiatric case management assisted outpatient treatment aot mental health and family mental health courts outpatient psychological and counseling services the staff for the community outpatient services at nnamhs includes a variety of disciplines including three psychologists working primarily in outpatient services and one psychologist working primarily in the dinitownsend psychiatric hospital the staff of both the inpatient and outpatient programs also include other disciplines such as licensed clinical social workers marriage and family therapists licensed alcohol and drug counselors psychiatrists advanced practice nurses registered nurses case managers mental health technicians and consumer service advocates internship experience  interns at nnamhs work in outpatient and inpatient settings serving adults experiencing a wide range of serious mental health problems interns receive supervision from staff psychologists our internship contributes to the development of competent clinical psychologists skilled in diagnosis psychological treatment psychological testing and behavioral consultation with seriously mentally ill adults interns learn risk assessment crisis intervention interviewing and assessment skills and other screening techniques psychological treatment includes individual as well as group therapy work in the inpatient and outpatient settings offer interns an opportunity to work closely with a variety of behavioral health professionals treatment approaches include empirically supported strategies including cbt dbt act psychodynamic psychotherapy motivational interviewing interpersonal psychotherapy and solutionfocused therapy the inpatient units at the dinitownsend hospital embrace a recovery model interns work with socioeconomically disadvantaged individuals who suffer from a wide range of psychopathology interns learn and practice batteries of psychological tests at the start of the year psychological testing experience includes not only interpretation of tests but also integration of interview and history data there is some degree of flexibility provided to accommodate individual intern interests in terms of the types of clients seen development and implementation of particular treatment groups and types of assessment activities site director jeffrey corpuel phd  jcorpuel healthnvgov    northern nevada adult mental health services nnamhs nnamhs  ',0),(18,'node',' southern nevada adult mental health services snamhs  southern nevada adult mental health services snamhs  2 fulltime positions 1 clinicalgeneralist appic program code 232312 1 clinicalforensic track appic program code 232315  general information  the southern nevada adult mental health services snamhs is a behavioral health system that consists of an 88bed civil inpatient psychiatric hospital a 78bed forensic inpatient hospital and four outpatient community mental health clinics snamhs provides psychiatric and behavioral health services to a diverse population of underserved adults in southern nevada primarily in las vegas snamhs provides services to over 14000 clients each year including inpatient services at rawsonneal psychiatric hospital for civilly committed patients inpatient forensic services at stein hospital for patients committed for adjudicative competency concerns assistive outpatient treatment aot er crisis assessments and psychiatric holds specialty courts mental health court drug court housing and residential programs consumer drop in centers medication management counseling and supportive services at outpatient clinics the department of forensic and civil psychology at snamhs provides inpatient services including psychological testing eg malingering personality cognitive differential diagnosis clinical interviews evidencebased group and individual psychotherapy interventions eg dbt developing and implementing positive behavior support plans risk assessments participation on interdisciplinary team meetings clientspecific consultations implementation of a token economy system training for hospital staff psychologists on froensic units conduct specialty evaluations including adjudicative competence and comprehensive risk assessments the psychology team also provides training and support for the competency restoration program psychology outpatient services at snamhs can include initial comprehensive assessments and diagnostic evaluations psychological testing evidencebased group interventions and individual psychotherapy interventions the psychology department has regularly scheduled staff meetings that focus on continued training case consultation program development and administrative tasks we also provide monthly trainings open to all staff called tuesday talks internship experience  interns at snamhs develop skills and competencies in the assessment and treatment of serious mental illness smi cooccurring disorders and personality disorders interns develop and enhance their skills in the areas of professional development and clinical consultation interns at snamhs learn to practice as generalists providing diagnostic assessment consultation and treatment to a diverse urban population interns have access to snamhs extensive library of psycholical testing materials interns are provided supervised experiences by licensed psychologists in clinical assessment individual and group therapy development of research projects and psychoeducational workshops supervision for dbt cbt and mindfulnessbased individual and group interventions are available interns function as members of interdisciplinary treatment teams and provide consultation and crisis intervention support interns participate in weekly case consultation meetings with psychiatric students and residents interns learn to consult with direct care staff and to write and implement behavior plans in addition to nvpic widedidatics interns at snamhs particiapte in weekly site didactic trainings and case presentations with postdocs practicum students and undergraduate field placements students facilitated primarily by dr bradley previous didactic topics have included expert testimony civil commitment malingering pai motivation interviewing and board complaints malpractice lawsuits interns provide a tuesday talks training during the internship year there are opportunities to participate in outreach events the snamhs internship offers one position each on two separate tracks one clinicalgeneralist position and one clinicalforensic position  snamhs clinicalgeneralist track appic program code 232312  the intern on the clinicalgeneralist track at snamhs works primarily with patients in our civil psychiatric hospital rawson neal engaged in activities to support the patients and treatment team the intern provides psychological assessments intervention services and consultation services as described above the intern placed at rawson neal may have opportunities to work with forensic patients as well snamhs clinicalforensic track appic program code 232315  the intern on the clinicalforensic track at snamhs works with patients who were referred by the court for adjudicative competence concerns the intern working with the forensic population learns case law related to adjudicative competence and learns how to conduct thorough record reviews write forensic evaluations interview forensic patients and conduct psychological and forensic testing when applicable interns have the opportunity to learn forensic assessment instruments such as the ecstr mfast sims sirs mcatca and tomm to name a few interns also learn to conduct comprehensive riskassessments for selfharm and violence site director  shera d bradley phd  sbradley healthnvgov   ',0),(19,'node',' carson city rural clinical ccrc  carson city rural clinic ccrc  1 fulltime position appic program code 232314 general information  the rural clinics agency provides behavioral health care to underserved individuals with serious behavioral health needs located within one of the 15 rural counties in nevada the intern works out of the carson city clinic one of the rural clinics agencies located at the foot of the sierra nevada mountains and approximately 30 minutes from the reno area carson city serves as the state s capitol and is home to just over 50000 residents the carson city rural clinic ccrc employs two full time psychologists as well as several master s level clinicians psychiatric nurses psychiatric case managers psychiatrists and psychiatric nurse practitioners ccrc often serves as a training site for practicum and intern students of various disciplines the professional staff at ccrc provide services to clients both in person and through telehealth to clients based in more remote areas of the state ccrc staff also provides behavioral health oncall coverage via telehealth to emergency rooms in rural hospitals throughout the state staff at the carson clinic are involved in several community partnerships including mobile crisis mental health court and juvenile justice diversion the clinic provides outpatient services to approximately 900 children adolescents and adults per year internship experience  interns placed at ccrc work as part of an interdisciplinary team at an outpatient community behavioral health clinic the intern provides intervention and assessment services to clients inperson in carson city and to individuals located in more rural and frontier communities throughout nevada through telehealth interns provide individual group and family therapy conduct initial intake assessments and provide comprehensive psychological assessments the intern placed at ccrc receives inperson supervision from one primary psychologist supervisor with opportunities to receive inperson and or telesupervision from other rural clinic psychologists interns receive training to meet the needs of a smaller community by learning to practice as a generalist working with a wide array of clients common presenting issues include but are not limited to trauma depression and anxiety psychosis cooccurring issues family distress interpersonal skill deficits and general distress related to issues of poverty stigma and isolation interns at ccrc are expected to work with clients across the age spectrum but may be provided some flexibility to focus their caseload predominantly on adults or youth and families if desired additionally the intern may have the opportunity to receive some exposure to communitybased activities such as community outreach education prevention schoolbased or homebased services or criminal justice diversion programs finally interns may gain some opportunities to witness and or participate in the statelegislative proceedings including policy work on issues specific to psychology or behavioral health in general site director  don campbell psyd  dcampbell healthnvgov    carson city rural clinic ccrc ccrc  ',0),(20,'node',' nvpic faculty northern nevada adult mental health services nnamhs  jeffrey corpuel phd phone number 7756882064 mailing address 480 galletti way sparks nv 89431 email address  jcorpuel healthnvgov roles at nvpic group supervisor nnamhs site director primary supervisor training committee member dr jeffrey corpuel has been a practicing psychologist for 34 years with a psychodynamic theoretical orientation he specializes in doing intensive individual psychotherapy and interpersonal group psychotherapy he has particular interest in treating the underserved and helping those who are suffering most dr corpuel has a professional focus on the training supervision and professional development of interns and early career mental health professionals he is the nvpic site director for nnamhs kambiz alaei phd email address  kalaei healthnvgov roles at nvpic training committee member secondary supervisor dr kambiz alaei is a licensed psychologist and the director of outpatient psychology and counseling services at the northern nevada adult mental health services nnamhs he completed his ba in psychology from the university of tehran iran he came to the united states in 1977 to pursue his graduate work he attended graduate schools in wichita kansas and san diego california where he obtained his master and phd degrees in psychology respectively dr alaei has practiced in the field of psychology for over thirty years after twenty years of working in private sectors he joined the state of nevada as a licensed psychologist i in 2000 and has since worked with seriously mentally ill consumers he has a parttime private practice dr alaei has provided a wide spectrum of clinical services to children adolescents adults and their families inpatient and outpatient settings services include clinical assessment psychological testing competency evaluation crisis intervention and individual and group therapy he has received trainings in multiple areas of the psychological field eg cbt dbt act mi imr through the years dr alaei has provided clinical supervision to many staff at different levels of their professional career state and private clinicians master and doctoral level interns and postdoctoral fellows he has participated in program development and evaluation consultation training and educating staff in evidencebased practices and interventions when he is not in session glued to his computer desk or in meetings he spends time with his family works in the garden plays soccer hikes jogs and socializes with friends he currently resides in reno nevada with his wife daughter and family cat chester  carson city rural clinic ccrc  sean dodge psyd phone number 7757823671 ext 239 mailing address 1528 us hwy 395 north suite 100 gardnerville nv 89410 email address  sdodge healthnvgov roles at nvpic outgoing training director secondary supervisor training committee member dr sean dodge has worked for the nevada division of public and behavioral health s rural clinics agency since 2010 he has served as the nvpic training director from its inception through 2017 dr dodge earned his psyd from pacific university in oregon with a focus on adolescent psychology dr dodge completed his internship at an adolescent treatment facility in doylestown pa and moved to nevada in 2009 to complete his postdoctoral training working with adults at nnamhs dr dodge s training and experience has almost exclusively focused on treating adolescents and adults in community behavioral health settings dr dodge has been trained in and practices from an acceptance and commitment therapy act perspective dr dodge also has many years of training and experience with a wide range of psychological assessments including objective personality cognitive and neurocognitive measures in addition to direct clinical work dr dodge s professional interests include training and supervision treatment effectiveness for underserved clients and the role of psychology in community and public health including populationbased initiatives public policy and the integration of behavioral health with other social support services dr dodge serves as a secondary supervisor with a focus on child and adolescent cases psychological assessment and treatment from an act approach donald campbell phd email address  dcampbell healthnvgov roles at nvpic ccrc site director training committee member primary supervisor dr donald campbell grew up in new mexico and spent time in latin america and spain working as a graphics artist and teaching english as a second language he has a bachelor of arts degree from the university of new mexico and a master of arts degree in latin american studies from the university of new mexico he earned a master of science degree in clinical psychology from capella university his doctor of psychology degree was earned through argosy university in phoenix arizona dr campbell completed his doctoral internship at tarzana treatment centers in california and his postdoctoral training at apache behavioral health services in whiteriver arizona where he supervised the adult mental health program for the white mountain apache tribe dr campbell has been with the state of nevada since 2013 and brings a wealth of clinical and cultural knowledge to his current position of licensed psychologist i with carson city rural clinic ccrc  southern nevada adult mental health services snamhs  shera bradley phd phone number 7024866466 mailing address 6161 west charleston las vegas nv 89146 email address  sbradley healthnvgov roles at nvpic snamhs site director primary supervisor training committee member dr shera bradley earned her phd in clinical psychology from unlv in 2007 and has been a licensed psychologist since 2008 her educational focus has been forensic psychology since beginning her master s program in 1998 following graduation in 2007 dr bradley worked in a private practice setting 2007 to 2015 her private practice work was focused on conducting forensic evaluations including competency death penalty mitigation child custody and other civil and criminal evaluations further she created and founded a unique comprehensive outpatient treatment program for juvenile victims of human sex trafficking in 2007 she has been interviewed on several occasions