e from individuals who have directly supervised your work as part of the online aapi official transcripts of all graduate coursework as part of the online aapi supplementary materials include a writing sample such as an integrated assessment report or a clinical case conceptualization please redact appropriately optional voluntary materiais interns who match with nvpic are the employees of the western interstate commission for higher education wiche it is the policy of wiche to provide equal employment opportunity to all qualified applicants as an affirmative action employer wiche is required to invite all applicants to complete certain forms completion of the forms is voluntary and will not subject you to any adverse treatment the information on these forms is confidential and will be maintained separately from your application if you choose to do so please download the forms here  and upload it with your application remember that completion of this form is voluntary and in no way affects the decision regarding your application for employment all application materials must be received by december 1 in order to be considered applicants who are invited to interview will be notified by email on or before the december 15 deadline interviews will be scheduled in january and will occur either in person or via videoconference phone interviews will be provided in cases where videoconference is not an option applicants are encouraged but not required to visit consortium sites nvpic bases its selection process on the entire application package noted above however applicants who have met the following qualifications prior to beginning internship are considered preferred current enrollment and in goodstanding in a psychology doctoral program a minimum of 500 intervention hours experience with assessment dissertation proposal defended some experience or special interest in working with underserved or diverse populations in addition to the preferences noted above nvpic takes into consideration the potential commitment or interest of any prospective intern to remain in nevada following internship developing a strong behavioral health workforce is an important consideration for the state and an interest in remaining in nevada to join the workforce is considered a benefit in a potential intern questions regarding the application or interview process may be directed to the nvpic training director all interns who match to nvpic sites must provide proof of eligibility to work in the united states nvpic does not sponsor work visas interns must successfully pass a fingerprintbased background check before beginning employment and must provide results from a tuberculosis tb screening test from the previous 12months instructions for providing this information or completing the background check and tb screening will be sent out to all who match after the match is complete  nvpic application process and selection criteria  ',0),(26,'node',' diversity and nondiscrimination policy consistent with the policies of the division of public and behavioral health the nevada psychology internship consortium strongly values diversity and believes in creating an equitable hospitable appreciative safe and inclusive learning environment for its interns diversity among interns and supervisors enriches the educational experience promotes personal growth and strengthens communities and the workplace every effort is made by nvpic to create a climate in which all staff and interns feel respected comfortable and in which success is possible and obtainable nvpic strives to make every effort to increase awareness dispel ignorance and increase comfort with multicultural experiences nvpic s training program includes an expected competency in diversity training and multiple experiences are provided throughout the year to be sure that interns are both personally supported and welltrained in this area nvpic welcomes applicants from diverse backgrounds the training program believes that a diverse training environment contributes to the overall quality of the program nvpic provides equal opportunity to all prospective interns and does not discriminate because of a person s race color religion sex national origin age disability sexual orientation gender identity or any other factor that is not directly relevant to success as a psychology intern applicants are individually evaluated in terms of quality of previous training practicum experiences and fit with the internship if an applicant or intern requires accommodations he or she should contact the internship training director to initiate this process nvpic interns also are subject to and protected by the governor s policy against sexual harassment and discrimination which can be found here  http hrnvgov uploadedfiles hrnvgov content sections eeo discrimination perd4211governorspolicyshdpdf  complaints regarding discrimination or harassment involving employees of the division of public and behavioral health must be referred to the division s personnel officer  diversity and nondiscrimination policy  ',0),(27,'node',' due process and grievance procedures due process procedures  for situations in which a supervisor or other faculty member raises a concern about the functioning of a psychology intern these procedures are a protection of intern rights and are implemented to afford the intern with every reasonable opportunity to remediate problems and to receive support and assistance these procedures are not intended to be punitive definition of a problem for purposes of this document a problem is defined broadly as an interference in professional functioning which is reflected in one or more of the following ways 1 an inability and or unwillingness to acquire and integrate professional standards into one s repertoire of professional behavior 2 an inability to acquire professional skills to reach an acceptable level of competency and or 3 an inability to control psychological dysfunctions and or excessive emotional reactions which interfere with professional functioning it is a professional judgment as to when an issue becomes problematic rather than a behavior of concern intern trainees may exhibit behaviors attitudes or characteristics that while of concern and requiring attention are not unexpected or excessive for professionals in training issues typically become identified as problems that require remediation when they include one or more of the following characteristics the intern does not acknowledge understand or address the problem when it is identified the problem is not merely a reflection of a skill deficit which can be rectified by the scheduled sequence of clinical or didactic training the quality of services delivered by the intern is sufficiently negatively affected the problem is not restricted to one area of professional functioning a disproportionate amount of attention by training personnel is required the trainee s behavior does not change as a function of feedback and or time the problematic behavior has potential for ethical or legal ramifications if not addressed the intern s behavior negatively impacts the public view of the agency the problematic behavior negatively impacts the intern cohort the problematic behavior potentially causes harm to a patient and or the problematic behavior violates appropriate interpersonal communication with agency staff administrative hierarchy and definitions nvpic s due process procedure occurs in a stepwise fashion involving greater levels of intervention as a problem increases in persistence complexity or level of disruption to the training program faculty roles included herein are defined as follows supervisor any faculty member who provides direct supervision or teaching to an intern training director td the supervisor who functions as the director of training the td leads the internship training committee and serves as a voting member informal review when a supervisor believes that an intern s behavior is becoming problematic the first step in addressing the issue should be to raise the issue with the intern directly and as soon as feasible in an attempt to informally resolve the problem this may include increased supervision didactic training and or structured readings this process should be documented in writing in supervision notes and discussed with the training director and training committee but will not become part of the intern s professional file formal review if an intern s problem behavior persists following an attempt to resolve the issue informally or if an intern receives a rating below a 2 on any competency within the first 3month supervisory evaluation or below a 3 on any competency on any subsequent supervisory evaluation the following process is initiated the supervisor will meet with the td and intern within 10 working days to discuss the problem and determine what action needs to be taken to address the issue if the td is the intern s direct supervisor an additional supervisor and member of the training committee will be included in the meeting the intern will have the opportunity to provide a written statement related to his her response to the problem the intern must submit the response to his her primary supervisor and the td within 5 working days of the meeting described in step 1 after discussing the problem and the intern s response the supervisor and td may issue a decision of no cause which indicates the determination that the intern s actions may not constitute a formal problem but rather a concern as defined above in the definition of a problem the awareness of the concern may be sufficient to rectify the issue and many not warrant further formal remediation in this case the intern may choose to have a written statement identifying that a formal review was held and that the claim was dismissed due to no cause if elected the td will issue this statement within 10 working days of the meeting the statement will be placed in the intern s professional file and at the intern s discretion may be sent to the director of clinical training at the intern s doctoral institution the intern also may choose to have no documentation written and or sent to the director of clinical training issue an acknowledgement notice which formally acknowledges that the faculty is aware of and concerned with the problem that the problem has been brought to the attention of the intern what steps the faculty and intern will take to rectify the problem or skill deficits addressed by the inadequate evaluation rating and that the problem is not significant enough to warrant further remedial action at this time this notice will be issued within 10 working days of the meeting  place the intern on probation which defines a relationship such that the faculty through the supervisors and td actively and systematically monitor for a specific length of time the degree to which the intern addresses changes and or otherwise improves the problematic behavior or skill deficit the length of the probation period will depend upon the nature of the problem and will be determined by the intern s supervisor and td a written probation statement is shared with the intern and the director of clinical training at the intern s graduate institution and includes the actual behaviors or skills associated with the problem the specific recommendations for rectifying the problem the time frame for the probation during which the problem is expected to be ameliorated and the procedures designed to ascertain whether the problem has been appropriately rectified this statement will be issued within 10 working days of the decision at the end of this probation period the td will provide a written statement indicating whether or not the problem has been remediated this statement will become part of the intern s permanent file and also will be shared with the intern and sent to the director of clinical training at the intern s graduate institution in special cases the intern may be moved to another training site within nvpic this option would be applicable in situations in which it is believed that the intern s difficulties are the result of a poor fit between the intern and the training site and that the intern could be successful in a different placement this option would require a meeting of a review panel convened by the training director and will consist of the td the intern s primary supervisor and at least two other members of the training committee the intern may be requested to attend this meeting as well additional parties who are knowledgeable about the intern s abilities also may be involved in order to inform decision making this meeting if deemed necessary by the td will be convened within 10 working days of determining that the above processes a b or c were unable to rectify the problem adequately if the problem is not rectified through the above processes or if the problem represents gross misconduct or ethical violations that have the potential to cause harm the intern s placement within nvpic may be terminated the decision to terminate an intern s placement would be made by the entire training committee and would represent a discontinuation of participation by the intern within every aspect of the training program the training committee would make this determination during a meeting convened within 10 working days of learning of the gross misconduct or ethical violations determining that the above processes a b or c have not adequately rectified the problem or during the regularlyscheduled monthly training committee meeting whichever occurs first each training site will receive one vote the td may decide to temporarily suspend an intern s clinical activities during this period prior to a final decision being made if warranted in the event of dismissal appic and the director of clinical training at the intern s home doctoral program would be contacted appeals process if the intern wishes to challenge the decisions made he or she may request an appeals hearing before the training committee this request must be made in writing an email will suffice to the td within 10 working days of notification regarding the decision made in step 3 or 4 above if requested the appeals hearing will be conducted by a review panel convened by the td and consisting of the td or another supervisor if appropriate the intern s primary supervisor and at least two other members of the training committee the intern may request a specific member of the training committee to serve on the review panel the appeals hearing will be held within 10 working days of the intern s request the review panel will review all written materials and have an opportunity to interview the parties involved or any other individuals with relevant information the review panel may uphold the decisions made previously or may modify them the review panel has final discretion regarding outcome notifying the sponsoring doctoral program if either the acknowledgment notice or the probation action occurs the td will inform the intern s sponsoring university within 30 days indicating the nature of the inadequate rating the rationale for the action and the action taken by the faculty the intern shall receive a copy of the letter to the sponsoring university once the acknowledgment notice or probation is issued by the td it is expected that the status of the problem or inadequate rating will be reviewed no later than the next formal evaluation period or in the case of probation no later than the time limits identified in the probation statement if the problem has been rectified to the satisfaction of the faculty and the intern the sponsoring university and other appropriate individuals will be informed and no further action will be taken grievance grievance procedures  these guidelines are intended to provide the psychology intern with a means to resolve perceived conflicts interns who pursue grievances in good faith will not experience any adverse professional consequences for situations in which an intern raises a grievance about a supervisor staff member trainee or the internship program  informal review first the intern should raise the issue as soon as feasible with the involved supervisor staff member other trainee or td to informally resolve the problem formal review if the matter cannot be satisfactorily resolved using informal means the intern may submit a formal grievance in writing to the td if the td is the object of the grievance the grievance should be submitted to a site director the individual being grieved will be asked to submit a response in writing within 5 working days of receiving the formal grievance the td or other site director if appropriate will meet with the intern and the individual being grieved within 10 working days in some cases the td or other site director may wish to meet with the intern and the individual being grieved separately first the goal of the joint meeting will be to develop a plan of action to resolve the matter the plan of action will include the behavior associated with the grievance the specific steps to rectify the problem and procedures designed to ascertain whether the problem has been appropriately rectified the td or other site director will document the process and outcome of the meeting the intern and the individual being grieved will be asked to report back to the td or other site director in writing within 10 working days regarding whether the issue has been adequately resolved in situations where the nature of the grievance constitutes a potential violation of the subject of the grievance s contract with his or her employer agency the employer agency will be notified in accordance with the policies and procedures of the agency if the plan of action fails the td or other site director will convene a review panel consisting of him herself and at least two other members of the training committee within 10 working days the intern may request a specific member of the training committee to serve on the review panel the review panel will review all written materials and have an opportunity to interview the parties involved or any other individuals with relevant information the review panel has final discretion regarding outcome if the review panel determines that a grievance against an individual cannot be resolved internally or is not appropriate to be resolved internally then the issue will be turned over to the employer agency of the subject of the grievance to initiate the due process procedures outlined in his or her employment contract if the review panel determines that the grievance against the individual does not constitute a violation of his or her employment contract and can potentially be resolved internally the review panel will develop a second action plan that includes the same components as above the process and outcome of the panel meeting will be documented by the td and the other site director the intern and the individual being grieved will be asked to report in writing to the td or other site director regarding whether the issue has been adequately resolved within 10 working days the panel will reconvene within 10 working days of receiving the intern s and individual s report to again review written documentation and determine whether the issue has been adequately resolved if the issue is not resolved by the second meeting of the panel the issue will be turned over to the employer agency to initiate the due process procedures outlined in the employment contract  due process and grievance procedures  ',0),(28,'node',' intern evaluation and record maintenance procedures the nevada psychology internship consortium nvpic requires that interns demonstrate minimum levels of achievement across all training elements as outlined in the nvpic training competencies interns are expected to achieve an intermediate to advanced level of skill on each element and competency by the conclusion of the internship year interns are formally evaluated by their primary supervisor 3months into the internship year approximately november 7months into internship approximately march and at the conclusion of internship year approximately july evaluations are conducted using a standard rating form which includes comment spaces where supervisors include specific written feedback regarding the interns performance and progress the evaluation form includes information about the interns performance regarding all of nvpic s expected training competencies supervisors review these evaluations with the interns at each time interval and provide an opportunity for discussion if the intern has questions or concerns about the feedback a minimum level of achievement on each evaluation is defined as a rating of 3 for each training element the rating scale for each evaluation is a 6point likert scale with the following rating values  unsatisfactory fail 1 needing improvement 2 beginner 3 intermediate 4 proficient 5 advanced on the first formal evaluation 3months a score of 2 on any competency or training element will result in close monitoring by program supervisors a score of 1 on any competency or training element in the first evaluation will initiate the program s due process procedures if an intern receives a score less than 3 on any competency or training element on the second formal evaluation 7months or if supervisors have reason to be concerned about the student s performance or progress the program s due process procedures will be initiated the due process guidelines can be found on wwwnvpicorg and in the intern handbook interns are expected to achieve an intermediate to advanced level of skill on each element and competency by the conclusion of the internship year thus all interns must receive a rating of 3 or above on all training elements profession wide competencies and program specific competencies by the final evaluation to complete the program successfully additionally all nvpic interns are expected to complete 2000 hours of training during the internship year meeting the hours requirement attending required training experiences eg didactic seminars and obtaining sufficient ratings on all evaluations demonstrates that the intern has progressed satisfactorily through and completed the internship program feedback to the interns home doctoral program is provided at or near the midpoint and the culmination of the internship year doctoral programs are contacted within one month following the end of the internship year and informed that the intern has successfully completed the program if successful completion of the program comes into question at any point during the internship year or if an intern enters into the formal review step of the due process procedures due to a grievance by a supervisor or an inadequate rating on an evaluation the home doctoral program also will be contacted within 30 days this contact is intended to ensure that the home doctoral program which also has a vested interest in the intern s progress is kept engaged in order to support an intern who may be having difficulties during the internship year the home doctoral program is notified of any further action that may be taken by nvpic as a result of the due process procedures up to and including termination from the program in addition to the evaluations described above interns will complete a selfevaluation form three times during the internship year interns complete a selfevaluation at the beginning of the internship year 7months into internship march and at the conclusion of the internship year additionally interns will complete an evaluation of their supervisor and a program evaluation concurrent with the evaluations done by their supervisors november march and july in order to provide feedback that will inform any changes or improvements in the training program all evaluation forms can be located on wwwnvpicorg and in the intern handbook information about interns training experiences evaluations and certificates of completion are maintained in a secure digital location by the training director for future reference and credentialing purposes   intern evaluation and record maintenance procedures  ',0),(29,'node',' nvpic stipend benefits and resources the annual internship stipend across all consortium sites is 28000 interns are employed by the western interstate commission for higher education wiche wiche is an intergovernmental organization which provides consultation to nvpic and serves as the fiscal agent for the internship health benefits annual vacation professional and sick leave are provided for all interns in addition interns receive eleven paid nevada state holidays please see the state holiday calendar for dates questions regarding specific benefits packages can be directed to wiche s human resources department email  ttorline wicheedu  telephone 3035410292 interns are nonexempt employees and will be paid an hourly rate interns are expected to complete all training experiences within a 40hour workweek prior approval is required for overtime in almost all circumstances approval for overtime will not be granted interns will submit timesheets to wiche on a biweekly basis please see the intern payroll schedule for more information interns receive 10 days 80 hours of paid time off pto and 11 paid nevada state holidays during the internship year additionally interns are eligible for up to 3 days 24 hours of professional development release time which can include conferences trainings dissertation time or other as approved by supervisors travel time is not included if travel is required for professional development opportunities it is considered pto interns should submit requests for pto or professional development release time to their primary supervisor at least two weeks in advance of the anticipated leave date for approval using the nvpic leave request form the request then will be communicated to the intern s site director and the nvpic training director interns are expected to refrain from making travel arrangements until supervisor approval has been granted for pto or professional development release time interns are responsible for communicating anticipated absences to all supervisors for whom work will be missed sick leave must be communicated to supervisors in the appropriate manner for each site as soon as the intern is physically able to do so supervisors are available for any questions related to time off or release time any additional time taken off if necessary may result in the internship year being extended beyond 12months nvpic interns have access to numerous resources all interns are provided with office space a desk work computer office phone voicemail printers software business cards id badges and other basic office supplies intervention manuals assessment materials other training materials access to the dsm 5 and icd10 and additional materials as needed and approved are provided at each training site and additional materials that may be needed may be purchased with training committee approval software for digital scoring of test batteries is available at each site funding for travel within the state of nevada is provided in order for interns to complete required training experiences and interns have access to state vehicles if needed for instate travel in addition to weekly didactic seminars and other professional trainings interns have access to a limited number of online academic journals through the division of public and behavioral health dpbh intranet each intern has access to administrative and it support   stipend benefits and resources  ',0),(30,'node',' mandatory training activities attendance policy attendance at weekly didactic seminars group supervision and the peer professional development group is mandatory for all interns in the nevada psychology internship consortium nvpic and required for successful completion of the internship attendance at these scheduled activities takes priority over other site obligations unless otherwise noted didactic seminars are held on tuesdays from 8301030am peer professional development group is held on tuesdays from 1100am1200pm group supervision is held on wednesdays from 8301030am all supervisors are aware of these activities and the attendance requirement for interns attendance at didactic seminars group supervision and the peer professional development group occurs via distancemediated technology interns and the group facilitator will participate from their respective office computers over a hipaacompliant secure telecommunications platform interns are expected to participate fully and actively in each of these mandatory activities interns should not be checking email surfing the internet completing notes or doing other computerrelated or nonrelevant activities during didactic seminars group supervision or peer professional development group the training director must be notified in advance of scheduled pto or professional development release time that will require missing a mandatory training activity if an intern misses a didactic seminar group supervision or peer professional development group meeting because of a serious emergency or for a serious illness he or she should alert the group facilitator and the training director as soon as possible attendance at each didactic seminar group supervision and peer professional development group meeting is tracked by nvpic and absences are reported to the training director attendance at didactics is tracked via completion of a didactic evaluation form interns who do not complete an evaluation form will be considered as having missed the didactic interns who miss more than 3 didactic seminars may be required to work with their supervisor to come up with a plan to make up for missed learning experiences attendance at group supervision and peer professional development group is tracked by the group facilitators all absences are reported to the training director missing more than three sessions of group supervision or peer professional development group will be dealt with on a casebycase basis and an appropriate response will be determined unexcused absences from mandatory training activities may result in initiating the nvpic due process procedures   mandatory training activities attendance policy  ',0),(31,'node',' videoconference supervision policy the nevada psychology internship consortium nvpic uses videoconferencing to provide weekly group supervision to all interns this format is utilized in order to promote interaction and socialization among interns and faculty interns and faculty meet in a virtual conference room and interact via highquality realtime transmission of simultaneous video and audio group supervision in this format is required for all current nvpic interns for two hours each week at a regularly scheduled time in addition to a required facilitated peer professional development group in this format for one hour each week at a regularly scheduled time as well as didactic opportunities in this format for two hours each week group supervision is led by a member of the nvpic training faculty the facilitated peer professional development group is led by a licensed psychologist who is not a member of the training committee in order to allow interns the opportunity to process and consult among themselves but still with the supervision and facilitation of a licensed psychologist nvpic places high value on cohesion and socialization of intern cohorts and virtual meetings via videoconferencing are an effective way to foster connection during the intervals between inperson meetings the use of videoconference technology for supervisory experiences is consistent with nvpic s model and training philosophy as nvpic places a strong training emphasis on access to behavioral healthcare which often includes the use of telehealth services nvpic recognizes the importance of supervisory relationships group supervision is led by a member of the core nvpic training faculty in order to provide interns with the opportunity to experience a breadth of supervisory relationships and supervision modalities the facilitation of the peer professional development group by a licensed psychologist who is not a member of the training committee also allows interns to experience a breadth of supervisory relationships given the geographical distance between training sites this model allows the interns to form greater connection to the training faculty and licensed psychologists in nevada than would be experienced otherwise it is expected that the foundation for these supervisory relationships will be cultivated initially during nvpic s orientation such that interns will have formed relationships with the training faculty prior to engaging in videoconference group supervision and peer professional development for all clinical cases discussed during group supervision full professional responsibility remains with the intern s primary supervisor and any crises or other timesensitive issues are reported to that supervisor immediately interns are provided contact information for all nvpic supervisors including email and phone numbers so crises and timesensitive information can be reported as necessary all nvpic videoconferencing occurs over a secure network using stateadministered technology supervision sessions using this technology are never recorded thus protecting the privacy and confidentiality of all trainees all interns are provided with instruction regarding the use of the videoconferencing equipment at the outset of the training year technical difficulties that cannot be resolved on site are directed to the office of information technology oit help desk   videoconference supervision policy  ',0),(32,'node',' social media policy the nevada psychology internship consortium nvpic social media policy applies to all nvpic interns regarding the use of social media with clients and nvpic faculty unless otherwise mentioned this policy applies specifically to the use of social media and does not include the use of text message voicemail email or other forms of technology interns will not use social media or other internetbased tools eg googling to interact with or lookup client information unless the intern receives prior approval from his or her supervisor if requested to look at a social media site eg facebook profile by a client interns will use their judgment about the clinical utility of doing so and will do so only on the client s device during the therapy session interns are permitted to look up client information regarding legal charges on law enforcement or government websites interns should use only state equipment eg office phone to communicate with clients emailing with clients or guardians is generally prohibited as a means of communication email contact with clients or guardians may be permissible on rare occasions with approval from the intern s supervisor it is the policy of nvpic that interns will not use social media to interact with members of the training committee supervisors or other faculty members following the completion of internship training social media contact with nvpic training committee members and supervisors is permitted to the extent that interns and faculty members are comfortable and mutually agree to do so interns are encouraged to review the security settings of all social media sites and profiles to ensure they understand what information about themselves is publically available if an intern has questions related to information contained within this policy or about security settings of social media sites he or she is encouraged to speak with his or her primary supervisor or the nvpic training director  social media policy  ',0),(33,'node',' family medical leave policy family medical leave  wiche provides interns with up to 12 work weeks of unpaid jobprotected leave within a 12month period and provides health benefits during the leave up to 12 weeks unpaid leave may be granted in the following circumstances intern serious health condition pregnancyrelated disability father s attendance at birth of child parent s care of newborn if completed within 12 months following birth of child placement of a child with intern for adoption or foster care serious health condition of intern s child under 18 years or older child if disabled or serious health condition of intern s spouse or parent  requesting leave  whenever possible interns must notify wiche human resources at least 30 days prior to the leave of absence requests for leave should be made in writing to human resources stating the reason for the leave the starting date and the planned date for return to work  disability insurance  during parental leave interns may be granted up to 6 weeks for vaginal delivery or up to 8 weeks for csection delivery of temporary disability insurance payment this amounts to 60 of average weekly wages during the designated time period disability payments for other types of medical leave are also paid at 60 and length of disability payments vary depending on the medical condition and when the doctor releases the patient to return to work a maximum of 173 days is allowed under the shortterm disability insurance plan  health insurance  if an intern is currently covered by wiche s insurance plans these benefits continue for interns on family or medical leave wiche will pay for intern and any eligible dependents insurance premiums while on unpaid leave if the intern is able but does not return to work after the expiration of the leave the intern will be required to reimburse wiche for payment of insurance premiums during the leave children may be added to the intern s health insurance policy if coverage is elected within 30 days of the birth or adoption children also can be added to the intern s health insurance within 30 days of the date of birth or 30 days of another qualifying event such as loss of coverage please contact human resources for more information  return to work  interns must contact wiche human resources at least two days before their first day of return from leave if the leave is for an intern s own serious health condition the intern must provide medical certification verifying ability to return to work failure to return to work on the day after the expiration of leave may result in termination of employment if the intern is unable to return to work the intern must provide medical certification no less than two days before the anticipated return date  hours supplementation  interns are required to complete a 12month 2000hour internship the number of workdays taken off during a leave of absence will be added as an extension to the training year the intern should work closely with their site supervisor and the nvpic training director to develop a plan to complete all required training experiences upon return from leave the timeline for evaluations will be adjusted on a casebycase basis upon return from leave the nvpic training director the site supervisor and the intern will agree on a timeline for when formal evaluations will occur the intern must complete the full 12 months of training achieve 2000 training hours and receive satisfactory ratings on the final intern evaluation form in order to complete the internship  maximum length  interns must complete all requirements for completion of the internship no later than 18 months after the start of the internship interns who take up to 12weeks of family medical leave are still eligible for the full amount of the nvpic stipend as long as they complete 2000 hours of internship work within 18months of the internship start date a serious health condition is defined as follows 825113 for purposes of fmla serious health condition entitling an employee to fmla leave means an illness injury impairment or physical or mental condition that involves inpatient care as defined in 825114 or continuing treatment by a health care provider as defined in 825115 the term incapacity means inability to work attend school or perform other regular daily activities due to the serious health condition treatment therefore or recovery therefrom the term treatment includes but is not limited to examinations to determine if a serious health condition exists and evaluations of the condition treatment does not include routine physical examinations eye examinations or dental examinations a regimen of continuing treatment includes for example a course of prescription medication eg an antibiotic or therapy requiring special equipment to resolve or alleviate the health condition eg oxygen a regimen of continuing treatment that includes the taking of overthecounter medications such as aspirin antihistamines or salves or bedrest drinking fluids exercise and other similar activities that can be initiated without a visit to a health care provider is not by itself sufficient to constitute a regimen of continuing treatment for purposes of fmla leave conditions for which cosmetic treatments are administered such as most treatments for acne or plastic surgery are not serious health conditions unless inpatient hospital care is required or unless complications develop ordinarily unless complications arise the common cold the flu ear aches upset stomach minor ulcers headaches other than migraine routine dental or orthodontia problems periodontal disease etc are examples of conditions that do not meet the definition of a serious health condition and do not qualify for fmla leave restorative dental or plastic surgery after an injury or removal of cancerous growths are serious health conditions provided all the other conditions of this regulation are met mental illness or allergies may be serious health conditions but only if all the conditions of this section are met   family medical leave policy  ',0),(34,'node',' quick reference guide for nvpic minimum training requirements general requirements complete a monthly hours training log documenting hours of training during the internship year complete the following evaluations at the following timepoints selfevaluation beginning of internship 7months and end of internship year program evaluation 3months 7months and end of internship year supervisor evaluation 3months 7months and end of internship year didactic evaluations following each didactic achieve a 3 on all required competencies on supervisor evaluation of intern by end of internship year clinical requirements complete 2000 hours of training during the internship year as documented on the hours training log complete 500 hours of direct facetoface service provision as documented on the hours training log complete site required training in behavioral health intervention psychological assessment and consultation and systems collaboration complete all sitespecific training requirements and associated clinical documentation supervision and training requirements attend 2 hours per week of individual supervision at site attend 2 hours per week of nvpic group supervision attend 2 hours per week of nvpic didactic seminars attend 1 hour per week of nvpic peer professional development group complete nvpic required research project   quick reference guide for nvpic minimum training requirements  ',0),(35,'node',' admissions support and initial placement data date program tables are updated september 1 internship program admissions briefly describe in narrative form important information to assist potential applicants in assessing their likely fit with your program this description must be consistent with the program s policies on intern selection and practicum and academic preparation requirements  nvpic bases its selection process on a holistic review of the potential intern s application including the aapi cover letter cv standardized reference forms graduate transcripts and writing sample applicants with a minimum of 500 intervention hours experience with assessment and who have defended their dissertation proposal are preferred in addition nvpic prefers applicants who have some experience or special interest in working with underserved or diverse populations nvpic takes into consideration the interest of any prospective intern to remain in nevada following internship as developing a strong behavioral health workforce is an important consideration for the state total direct contact assessment hours does the program require that applicants have received a minimum number of hours of the following at time of application if yes indicate how many   yes no amount total direct contact intervention hours  n  total direct contact assessment hours  n   describe any other required minimum criteria used to screen applicants  nvpic prefers applicants who have at least 500 intervention hours and some experience with assessment but nvpic does not have any minimum requirements or screenout criteria financial and other benefit support for upcoming training year 1 annual stipend salary for fulltime interns 28000 annual stipend salary for halftime interns n a yes no program provides access to medical insurance for intern yes if access to medical insurance is provided trainee contribution to cost required no coverage of family member s available yes coverage of legally married partner available yes coverage of domestic partner available yes  hours of annual paid personal time off pto and or vacation   80 hours hours of annual paid sick leave  n a nvpic provides 10 days 80 hours of pto total inclusive of vacation and sick time in the event of medical conditions and or family needs that require extended leave does the program allow reasonable unpaid leave to interns residents in excess of personal time off and sick leave  yes  other benefits please describe    initial postinternship positions  aggregated tally for preceding 3 cohorts  2 date range 201516 to 201617 total of interns who were in the 3 cohorts 8 total of interns who did 